	(24,13,'text','<p>Even though using \"lorem ipsum\" often arouses curiosity due to its resemblance to classical Latin, it is not intended to have meaning. Where text is visible in a document, people tend to focus on the textual content rather than upon overall presentation, so publishers use lorem ipsum when displaying a typeface or design in order to direct the focus to presentation. \"Lorem ipsum\" also approximates a typical distribution of spaces in English.</p>',NULL,NULL,NULL,NULL,NULL,1,'2019-02-27 15:16:49','2019-02-27 15:16:49'),
	(25,14,'text','<p>G&eacute;n&eacute;ralement, on utilise un texte en faux latin (le texte ne veut rien dire, il a &eacute;t&eacute; modifi&eacute;), le Lorem ipsum ou Lipsum, qui permet donc de faire office de texte d\'attente. L\'avantage de le mettre en latin est que l\'op&eacute;rateur sait au premier coup d\'oeil que la page contenant ces lignes n\'est pas valide, et surtout l\'attention du client n\'est pas d&eacute;rang&eacute;e par le contenu, il demeure concentr&eacute; seulement sur l\'aspect graphique.</p>',NULL,NULL,NULL,NULL,NULL,1,'2019-02-27 15:17:54','2019-02-27 15:17:54'),
