	(40,22,'text','<h1>Paris&nbsp;&ndash; Total annonce l&rsquo;acquisition de la soci&eacute;t&eacute; Synova, leader fran&ccedil;ais de la production de polypropyl&egrave;ne recycl&eacute; de haute performance destin&eacute; au secteur automobile.&nbsp;</h1>\r\n<p>&nbsp;Cette entreprise produit 20 000 tonnes par an de polypropyl&egrave;ne r&eacute;pondant aux hauts standards de qualit&eacute; des &eacute;quipementiers et constructeurs automobiles &agrave; partir de plastiques recycl&eacute;s.</p>\r\n<p>&nbsp;Associer le savoir-faire de Synova dans le recyclage et l&rsquo;expertise de Total dans les polym&egrave;res permettra de faire cro&icirc;tre l&rsquo;offre de polypropyl&egrave;ne recycl&eacute; pour l&rsquo;automobile aux performances &eacute;quivalentes &agrave; celles des polym&egrave;res vierges.</p>\r\n<p>&nbsp;</p>\r\n<p>&laquo;&nbsp;En contribuant &agrave; l&rsquo;all&egrave;gement des v&eacute;hicules, les plastiques am&eacute;liorent leur efficacit&eacute; &eacute;nerg&eacute;tique et permettent de r&eacute;duire les &eacute;missions de CO2. Les produire &agrave; partir de mati&egrave;res recycl&eacute;es permet en outre de r&eacute;pondre &agrave; l&rsquo;enjeu de la gestion de leur fin de vie&nbsp;&raquo;, a d&eacute;clar&eacute; Bernard Pinatel, directeur g&eacute;n&eacute;ral Raffinage-Chimie de Total. &laquo;&nbsp;L&rsquo;acquisition de Synova est une preuve concr&egrave;te de notre engagement &agrave; d&eacute;velopper le recyclage des mati&egrave;res plastiques. Elle renforce les activit&eacute;s que nous menons d&eacute;j&agrave; dans l&rsquo;&eacute;conomie circulaire et contribue &agrave; l&rsquo;ambition de Total d&rsquo;&ecirc;tre la major de l&rsquo;&eacute;nergie responsable.&nbsp;&raquo;</p>',NULL,NULL,'youtube',NULL,NULL,1,'2019-02-28 21:27:42','2019-02-28 21:27:42'),
