	(67,37,'text','<p>L\'application mobile PGM (Programme de gestion de mouvement), a pour objectif de donner plus d\'informations &agrave; l\'op&eacute;rateur de conduite en l\'aidant dans sa prise de d&eacute;cision pour la recherche et la configuration de nouveaux circuits de transfert des fluides.</p>\r\n<p>En service depuis janvier 2018 sur le secteur bitume de Feyzin, le projet PGM/myValves a vocation de s\'&eacute;tendre sur l\'ensemble de nos sites industriels.</p>\r\n<p><span style=\"text-decoration: underline;\">Objectif</span> : S&eacute;curiser la configuration des circuits.</p>\r\n<p>Red&eacute;couvrez son t&eacute;moignage en podcast.&nbsp;</p>\r\n<p>&nbsp;</p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-03-20 14:06:27','2019-03-20 14:06:27'),
	(68,37,'video',NULL,NULL,NULL,'damdy','https://total-mc33-front-pad.damdy.com/player-html5-68b8c2fd2689f8680ff1c45ff6f030af.html',NULL,1,'2019-03-20 14:06:27','2019-04-18 11:23:55'),
	(69,37,'text','<p>Pour en savoir plus, rendez-vous sur <em>WAT &gt;&nbsp;R&amp;C Awards 2018.</em></p>',NULL,NULL,'youtube',NULL,NULL,2,'2019-03-20 14:09:06','2019-03-20 14:09:06'),
	(70,38,'text','<p>La politique de la plateforme est l\'engagement de la direction dans la mise en &oelig;uvre d\'un syst&egrave;me de management int&eacute;gr&eacute; pour une am&eacute;lioration continue dans les domaines de la Qualit&eacute;, de l\'Hygi&egrave;ne, de la S&eacute;curit&eacute;, de l\'Environnement, de l\'Inspection, de la Disponibilit&eacute; et de l\'Energie.</p>\r\n<p>Elle traduit les orientations strat&eacute;giques du site dans le but d\'atteindre ses objectifs.</p>\r\n<p>La politique de la plateforme a &eacute;t&eacute; revue r&eacute;cemment pour &ecirc;tre en coh&eacute;rence avec notre Ambition et les 3 piliers intitul&eacute;s &laquo; HSE &raquo;, &laquo; excellence op&eacute;rationnelle &raquo;, &laquo; parties prenantes &raquo; avec la prise en compte du Code de Conduite et la mise en avant des parties prenantes.</p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-03-20 14:14:09','2019-03-20 14:14:09'),
	(71,38,'image',NULL,NULL,'PMEKbXL6WqOryKetjENamP97mpu2l4hnBLzA6KYK.jpeg','youtube',NULL,NULL,1,'2019-03-20 14:14:10','2019-03-20 14:14:10'),
	(72,39,'text','<p>Pour retrouver la version digitale anim&eacute;e de la BD \"Au coeur de la machine\", rendez - vous <a href=\"https://www.total.com/fr/expertise-energies/transformation-valorisation/raffinage-petrochimie/au-coeur-de-la-machine\" target=\"_blank\" rel=\"noopener noreferrer\">ICI</a>.&nbsp;</p>\r\n<p>A partager sans mod&eacute;ration !&nbsp;</p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-03-20 14:24:45','2019-03-25 14:08:14'),
	(73,40,'image',NULL,NULL,'7RMBDstBT7KfCB3Nrc9tGdyAzu3ciwpwDXrLmuvK.png','youtube',NULL,NULL,0,'2019-03-20 16:27:16','2019-03-20 16:29:48'),
	(74,41,'quote','<p>Poursuivre une grande histoire. Je pense &agrave; celles qui ont ouvert la voie il y a 40 ans et qui m&rsquo;ont permis de travailler aujourd&rsquo;hui dans une industrie &agrave; dominante masculine. Leurs sacrifices et leur t&eacute;nacit&eacute; ont chang&eacute; les mentalit&eacute;s pour que les femmes deviennent ing&eacute;nieures, superviseuses ou responsables s&eacute;curit&eacute; et soient les &eacute;gales de leurs coll&egrave;gues. J&rsquo;&oelig;uvre tous les jours &agrave; faire pareil pour la nouvelle g&eacute;n&eacute;ration de femmes.</p>','Hannah Sennett, Process Safety Management (PSM) Coordinator,  Raffinage Pétrochimie Amériques (RPA)',NULL,'youtube',NULL,NULL,0,'2019-03-21 14:51:54','2019-03-21 14:51:54'),
	(75,41,'quote','<p>Pour moi, avec une femme comme N+1, une femme comme N+2 et 90% de femmes dans mes &eacute;quipes &ndash; et m&ecirc;me plusieurs femmes dans mon &eacute;quipe de Touch Rugby, &ecirc;tre une femme au RC c\'est plut&ocirc;t tr&egrave;s courant ! Je suis conscient que ce n\'est pas le cas dans tous les m&eacute;tiers, mais pour ma part, dans aucun des m&eacute;tiers pr&eacute;sents chez Total il n\'y a lieu de faire de diff&eacute;rence entre les hommes et les femmes. Dans une pr&eacute;c&eacute;dente exp&eacute;rience en Arabie Saoudite j\'ai vu qu\'&ecirc;tre une femme pouvait &ecirc;tre plus difficile pour acc&eacute;der aux m&ecirc;mes postes que les hommes, mais SATORP a &eacute;t&eacute; la premi&egrave;re soci&eacute;t&eacute; dans toute la zone de Jubail &ndash; la plus grande zone industrielle du Moyen Orient &ndash; &agrave; faire travailler des femmes, y compris sur le terrain. C\'est une fiert&eacute; !</p>','David Welby, Chef de département Mobilité Internationale & Evaluation de poste,  Ressources humaines & Communication (RHC)',NULL,'youtube',NULL,NULL,1,'2019-03-21 14:51:54','2019-03-21 14:51:54'),
	(76,41,'quote','<p>Dans un m&eacute;tier Business, c&rsquo;est tout de m&ecirc;me &ecirc;tre assez seule&hellip; En tant que femme, non ing&eacute;nieure, on se retrouve dans un monde o&ugrave; les r&egrave;gles du jeu ont &eacute;t&eacute; faites par des hommes et pour les hommes. Mais cela change ! A titre d&rsquo;anecdote : il est arriv&eacute; que l&rsquo;on dise &laquo; Ah, voil&agrave; notre diversit&eacute; ! &raquo; quand j&rsquo;arrive en r&eacute;union. C&rsquo;est de l&rsquo;humour, et en aucun cas p&eacute;joratif : cela traduit juste tr&egrave;s simplement la mani&egrave;re dont est encore per&ccedil;ue la pr&eacute;sence des femmes dans les m&eacute;tiers Business.</p>','Géraldine Gros, Chargée d’affaires Mergers and Acquisitions,  Stratégie Développement Recherche (SDR)',NULL,'youtube',NULL,NULL,2,'2019-03-21 14:51:54','2019-03-21 14:51:54'),
