	(83,48,'text','<p>Quel est le principe ?</p>\r\n<p>Depuis quelques ann&eacute;es a &eacute;merg&eacute; un nouveau genre de m&eacute;c&eacute;nat&nbsp;dit &laquo;&nbsp;de comp&eacute;tences&nbsp;&raquo;. Traditionnellement financier, ce type d&rsquo;initiative consiste d&eacute;sormais en un apport en ressources humaines. Autrement dit une entreprise &ldquo;transf&egrave;re&rdquo; ses comp&eacute;tences et savoirs-faire au profit d&rsquo;une association en faisant intervenir ses collaborateurs sur leur temps de travail. Un ph&eacute;nom&egrave;ne en pleine croissance, la preuve :</p>\r\n<ul>\r\n<li>Plus de 80% des entreprises fran&ccedil;aises ont d&eacute;velopp&eacute; un ou plusieurs dispositifs d&rsquo;engagement solidaire &agrave; destination de leurs collaborateurs</li>\r\n<li>Plus de 50% des entreprises proposent du volontariat sur le temps de travail</li>\r\n<li>72% des associations sont convaincues que ce volontariat leurs permettrait d&rsquo;augmenter leur impact soci&eacute;tal.</li>\r\n</ul>\r\n<p>L&rsquo;engagement de Total</p>\r\n<p>Parce qu&rsquo;il est convaincu par ce type d&rsquo;initiative, le Groupe d&eacute;ploie des actions de solidarit&eacute; men&eacute;es chaque jour dans le monde via ses sites, ses filiales et sa fondation d&rsquo;entreprise. Avec ce programme de solidarit&eacute;, Total souhaite contribuer au d&eacute;veloppement des territoires sur lesquels il est pr&eacute;sent. Il s&rsquo;agit pour le Groupe de contribuer au bien commun et construire des relations de confiance et de proximit&eacute; avec ses partenaires. Une politique d&rsquo;accompagnement de la soci&eacute;t&eacute; civile qui s&rsquo;applique via quatre grands th&egrave;mes :</p>\r\n<ul>\r\n<li>la s&eacute;curit&eacute; routi&egrave;re,</li>\r\n<li>les for&ecirc;ts et le climat,</li>\r\n<li>l&rsquo;&eacute;ducation et l&rsquo;insertion des jeunes,</li>\r\n<li>le dialogue des cultures et le patrimoine. &nbsp;</li>\r\n</ul>\r\n<p>Envie d&rsquo;en savoir plus ? Retrouvez notre dossier sp&eacute;cial m&eacute;c&eacute;nat de comp&eacute;tence sur WAT.</p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-03-25 13:58:08','2019-03-25 13:58:08'),
	(84,43,'image',NULL,NULL,'pWhfesUCTkP8iAXzeQBSwFSRt3kngjF5vnbgEvE5.jpeg','youtube',NULL,NULL,1,'2019-03-26 17:59:28','2019-03-26 17:59:28'),
	(85,49,'text','<p><strong>Le p&eacute;trole et le gaz sont utilis&eacute;s dans de tr&egrave;s nombreux produits du quotidien&nbsp;: carburants, plastiques, r&eacute;sines&hellip; Leurs domaines d&rsquo;applications sont multiples : mobilit&eacute;, &eacute;lectrom&eacute;nager, emballage alimentaire et industriel et bien d&rsquo;autres encore. Servir l&rsquo;ensemble de ces besoins &agrave; travers le monde repr&eacute;sente un v&eacute;ritable d&eacute;fi. C&rsquo;est aussi notre mission.</strong><br /><br /></p>\r\n<p><strong>Asie &amp; Moyen-Orient : servir des march&eacute;s en pleine croissance</strong> <br /><br />L&rsquo;Orient est une zone de d&eacute;veloppement pour nos activit&eacute;s de raffinage et de p&eacute;trochimie. La demande en produits p&eacute;troliers sur les march&eacute;s asiatiques en croissance offre un d&eacute;bouch&eacute; important pour notre production. D&rsquo;autre part, notre pr&eacute;sence au Moyen-Orient nous permet d&rsquo;acc&eacute;der &agrave; des ressources disponibles en quantit&eacute; et plus avantageuses en termes de prix, et de profiter d&rsquo;une position g&eacute;ographique strat&eacute;gique pour servir les march&eacute;s de la zone.</p>\r\n<p>Nous op&eacute;rons dans ces r&eacute;gions deux plateformes de rang mondial, en partenariat avec de grands acteurs locaux.</p>\r\n<p>En Cor&eacute;e&nbsp;du&nbsp;Sud, nous sommes partenaires d\'Hanwha sur notre plateforme de Daesan o&ugrave; nous avons investi pr&egrave;s de deux milliards de dollars afin de doubler la capacit&eacute; du site et diversifier sa production. <br />En Arabie&nbsp;Saoudite, nous sommes partenaires de Saudi&nbsp;Aramco sur la toute r&eacute;cente plateforme de SATORP, la plus grande du Groupe. Elle transforme le brut lourd saoudien en produits &agrave; forte valeur ajout&eacute;e, destin&eacute;s en priorit&eacute; &agrave; l&rsquo;Asie et au Moyen-Orient.</p>\r\n<p><strong>Am&eacute;rique du Nord : la r&eacute;volution des gaz de schiste<br /></strong><br />L&rsquo;exploitation des gaz de schiste a donn&eacute; un nouveau souffle &agrave; notre activit&eacute; industrielle en Am&eacute;rique du Nord. Notre pr&eacute;sence dans la r&eacute;gion nous permet d&rsquo;acc&eacute;der &agrave; un gaz naturel et p&eacute;trole abondant et donc peu co&ucirc;teux pour alimenter nos usines de production. La raffinerie acc&egrave;de ainsi aux bruts domestiques l&eacute;gers issus des schistes, et le vapocraqueur craque &agrave; plus de 80% de l&rsquo;&eacute;thane et des GPL, qui remplacent le naphta, une ressource plus ch&egrave;re. Pour poursuivre cette strat&eacute;gie,&nbsp; des &eacute;tudes d&rsquo;ing&eacute;nierie pour un nouveau craqueur &eacute;thane ont &eacute;t&eacute; lanc&eacute;es.</p>\r\n<p><strong>Europe : investir pour satisfaire une demande mature<br /><br /></strong></p>\r\n<p>Socle historique de nos activit&eacute;s et de notre savoir-faire, le continent europ&eacute;en concentre la majeure partie de nos installations industrielles. C&rsquo;est un march&eacute; en pleine mutation : baisse de la demande en raison de nouvelles motorisations plus &eacute;conomes en &eacute;nergie, besoin tourn&eacute; vers le diesel en raison d&rsquo;incitation fiscale, r&eacute;glementations toujours plus exigeantes&hellip;</p>\r\n<p>Pour nous adapter &agrave; cette nouvelle donne et rendre nos sites plus comp&eacute;titifs, nous concentrons nos investissements sur nos plateformes int&eacute;gr&eacute;es raffinage-p&eacute;trochimie et sur des activit&eacute;s &agrave; tr&egrave;s haute valeur ajout&eacute;e.</p>\r\n<p>&nbsp;</p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-08 10:47:53','2019-04-08 10:54:46'),
	(86,49,'image',NULL,NULL,'mhSrZDxTkoUNKiwjJeLlFRG8T1BOHmrPfNfKA3mF.jpeg','youtube',NULL,NULL,1,'2019-04-08 10:47:54','2019-04-08 10:47:54'),
	(87,50,'text','<p><strong>La s&eacute;curit&eacute;&nbsp;est une valeur fondamentale de notre Groupe et&nbsp;le premier&nbsp;crit&egrave;re de notre excellence op&eacute;rationnelle. Elle est au c&oelig;ur de toutes nos activit&eacute;s et le fondement de notre culture industrielle. Une culture de l&rsquo;excellence qui passe &eacute;galement par l&rsquo;am&eacute;lioration continue de l&rsquo;efficacit&eacute; op&eacute;rationnelle et &eacute;nerg&eacute;tique de nos installations.</strong></p>\r\n<p><strong>La s&eacute;curit&eacute; : une valeur fondamentale<br /><br /></strong>Chez Total, la s&eacute;curit&eacute; est une valeur fondamentale et la condition de la p&eacute;rennit&eacute; de nos activit&eacute;s. Nous transformons des produits, les hydrocarbures, qui par leur nature pr&eacute;sentent des risques sp&eacute;cifiques qu&rsquo;il nous appartient de conna&icirc;tre et de ma&icirc;triser. Nous sommes responsables de la s&eacute;curit&eacute; de nos collaborateurs, de nos prestataires et de nos riverains. Pour mettre en place et faire appliquer notre culture s&eacute;curit&eacute;, nous avons formalis&eacute; un certain nombre de r&egrave;gles : nos 12&nbsp;r&egrave;gles d&rsquo;or de la s&eacute;curit&eacute; au poste de travail.</p>\r\n<p><strong>Les synergies raffinage-p&eacute;trochimie pour l&rsquo;efficacit&eacute; op&eacute;rationnelle</strong><br /><br />Chez Total, le raffinage et la p&eacute;trochimie sont deux activit&eacute;s int&eacute;gr&eacute;es. Leurs proc&eacute;d&eacute;s techniquement proches nous permettent de d&eacute;gager des synergies conduisant &agrave; plus d&rsquo;efficacit&eacute; op&eacute;rationnelle. Sur des sites industriels appel&eacute;s &laquo; plateformes int&eacute;gr&eacute;es &raquo;, nos unit&eacute;s de raffinage et de p&eacute;trochimie sont reli&eacute;es pour faciliter les &eacute;changes de mati&egrave;res premi&egrave;res et le partage de l&rsquo;&eacute;nergie n&eacute;cessaire pour produire. Ce choix strat&eacute;gique nous permet notamment de r&eacute;aliser des &eacute;conomies de fonctionnement pour am&eacute;liorer la comp&eacute;titivit&eacute; de nos sites.</p>\r\n<p><strong><strong>Disponibilit&eacute; : assurer la continuit&eacute; de nos op&eacute;rations</strong></strong></p>\r\n<p>Nos march&eacute;s sont particuli&egrave;rement volatiles et les marges sensibles au prix du p&eacute;trole, aux conditions climatiques ou encore &agrave; la conjoncture &eacute;conomique. La disponibilit&eacute; de notre outil industriel, c&rsquo;est-&agrave;-dire sa capacit&eacute; &agrave; produire en continu, est essentielle pour saisir des opportunit&eacute;s de march&eacute; au moment o&ugrave; elles se pr&eacute;sentent.</p>\r\n<p>Pour am&eacute;liorer notre disponibilit&eacute; moyenne, nous avons mis en place une m&eacute;thodologie industrielle, fond&eacute;e sur les meilleures pratiques du raffinage et de la p&eacute;trochimie. Les gains obtenus nous feront progresser sur tous les sujets op&eacute;rationnels : s&eacute;curit&eacute;, conduite des op&eacute;rations, maintenance, efficacit&eacute; &eacute;nerg&eacute;tique, protection de l&rsquo;environnement.</p>\r\n<p><em>Pour en savoir plus, rendez-vous sur : <a href=\"https://www.total.com/fr/expertise-energies/transformation-valorisation/raffinage-petrochimie/excellence-operationnelle\" target=\"_blank\" rel=\"noopener noreferrer\">www.total.com.</a></em></p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-08 10:52:29','2019-04-08 10:56:15'),
	(88,49,'text','<p><em>Pour en savoir plus, rendez-vous sur : <a href=\"https://www.total.com/fr/expertise-energies/transformation-valorisation/raffinage-petrochimie/servir-demande-produits-petroliers-monde\" target=\"_blank\" rel=\"noopener noreferrer\"><span style=\"text-decoration: underline;\">www.total.com</span></a>.</em></p>',NULL,NULL,'youtube',NULL,NULL,2,'2019-04-08 10:54:46','2019-04-08 10:54:46'),
	(89,51,'text','<p><strong>Notre vocation est d\'&ecirc;tre un partenaire de choix du secteur aval p&eacute;trolier pour collaborer aux projets industriels qui se dessinent et se r&eacute;alisent partout dans le monde. Pour cela, nous apportons notre savoir-faire et notre approche int&eacute;gr&eacute;e dans le domaine de l&rsquo;&eacute;nergie. Notre capacit&eacute; d&rsquo;adaptation et nos succ&egrave;s dans les relations interculturelles sont aussi notre fiert&eacute; et un atout pour convaincre nos parties prenantes.</strong></p>\r\n<p><strong>Une exp&eacute;rience reconnue dans la gestion de grands projets<br /></strong><br />Pr&eacute;sents sur plusieurs continents, nous g&eacute;rons de grands complexes depuis de nombreuses ann&eacute;es. C&rsquo;est cette exp&eacute;rience qui nous permet aujourd&rsquo;hui de nouer des collaborations durables avec nos partenaires.&nbsp;<br />Nous mettons &agrave; leur disposition nos principaux atouts :</p>\r\n<ul>\r\n<li>expertise technique ;</li>\r\n<li>respect des d&eacute;lais et des budgets, v&eacute;ritable gage de confiance ;</li>\r\n<li>savoir-faire manag&eacute;rial interculturel fond&eacute; sur l&rsquo;&eacute;change, un &eacute;l&eacute;ment f&eacute;d&eacute;rateur pour les diff&eacute;rentes nationalit&eacute;s qui peuvent composer les &eacute;quipes ;</li>\r\n<li>capacit&eacute;s de financement d&rsquo;un grand groupe international.</li>\r\n</ul>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-08 11:04:08','2019-04-08 11:04:08'),
	(90,51,'quote','<p>SATORP est le r&eacute;sultat d&rsquo;un solide partenariat entre Total et Saudi Aramco et de leur d&eacute;termination &agrave; construire ensemble l\'une des raffineries les plus complexes et les plus performantes au monde.</p>','Fawwaz I. Nawwab, président-directeur Général de SATORP',NULL,'youtube',NULL,NULL,1,'2019-04-08 11:04:08','2019-04-08 11:04:08'),
	(91,51,'text','<p><strong>La force d&rsquo;un Groupe int&eacute;gr&eacute; sur l&rsquo;ensemble de la cha&icirc;ne de valeur</strong><br /><br />Nos activit&eacute;s de raffinage-p&eacute;trochimie sont int&eacute;gr&eacute;es aux autres activit&eacute;s du Groupe, de l&rsquo;exploration-production de p&eacute;trole et de gaz jusqu&rsquo;&agrave; la distribution de produits p&eacute;troliers. C&rsquo;est pour nos partenaires, comme pour nous, un facteur de diff&eacute;renciation d&eacute;terminant.</p>\r\n<p>La coop&eacute;ration avec nos activit&eacute;s d\'exploration et de production de p&eacute;trole et de gaz nous permet d&rsquo;accompagner nos partenaires dans la valorisation de leurs ressources et le d&eacute;veloppement de leurs industries. Notre vaste r&eacute;seau de distribution de gros comme de d&eacute;tail, garantit le d&eacute;bouch&eacute; de nos productions et celles de nos partenaires. Nos activit&eacute;s de n&eacute;goce et de transport s&eacute;curisent, quant &agrave; elles, l&rsquo;approvisionnement de nos plateformes.</p>',NULL,NULL,'youtube',NULL,NULL,2,'2019-04-08 11:04:08','2019-04-08 11:04:08'),
	(92,51,'image',NULL,NULL,'f7YF4USj8QPO8JPzIaNaX8YMSHy7Wi0gkoiK8KEr.jpeg','youtube',NULL,NULL,3,'2019-04-08 11:04:09','2019-04-08 11:04:09'),
	(93,51,'text','<p><em>Pour en savoir plus, rendez-vous sur: <a href=\"https://www.total.com/fr/expertise-energies/transformation-valorisation/raffinage-petrochimie/partenariats-durables\" target=\"_blank\" rel=\"noopener noreferrer\">www.total.com</a>.</em></p>',NULL,NULL,'youtube',NULL,NULL,4,'2019-04-08 11:04:09','2019-04-08 11:04:09'),
	(94,52,'text','<p><strong>Nous sommes un acteur industriel majeur en Europe et cette position nous conf&egrave;re une responsabilit&eacute; dans notre secteur d&rsquo;activit&eacute;. Pour accompagner la mutation profonde du raffinage-p&eacute;trochimie, il nous revient d&rsquo;anticiper et de nous adapter aux nouvelles exigences du march&eacute; dans le cadre d&rsquo;une d&eacute;marche sociale responsable.</strong></p>\r\n<p><strong>Une d&eacute;marche soci&eacute;tale innovante pour anticiper l&rsquo;avenir de nos sites</strong></p>\r\n<p>Le march&eacute;́ europ&eacute;en est marqué par une baisse durable de la consommation de produits p&eacute;troliers ainsi que par des d&eacute;s&eacute;quilibres significatifs entre la demande et l&rsquo;offre. Pour y faire face, nous avons r&eacute;duit nos capacit&eacute;s de raffinage et r&eacute;alis&eacute; des adaptations industrielles de grande ampleur. C&rsquo;est la condition absolue pour assurer un avenir p&eacute;renne &agrave; nos sites.</p>\r\n<p>La r&eacute;ussite de cette transition repose sur l&rsquo;anticipation et l&rsquo;implication de toutes les parties prenantes. Notre d&eacute;marche d&rsquo;acteur responsable repose avant tout sur la concertation. Nous nous attachons aussi &agrave; maintenir dans l&rsquo;emploi nos collaborateurs en tenant compte de leurs comp&eacute;tences sp&eacute;cifiques.</p>\r\n<p>Nous sommes &eacute;galement un partenaire &eacute;conomique majeur des r&eacute;gions dans lesquelles nous sommes implant&eacute;s. Nous contribuons &agrave; leur d&eacute;veloppement social, &eacute;conomique et environnemental. Ainsi, nous menons des actions volontaires de d&eacute;veloppement &eacute;conomique en partenariat avec les collectivit&eacute;s locales et l&rsquo;&Eacute;tat.</p>\r\n<p><strong>La transition industrielle de Carling : une d&eacute;marche responsable</strong><br /> <br />Situ&eacute;e dans le d&eacute;partement fran&ccedil;ais de la Moselle, &agrave; la fronti&egrave;re avec l&rsquo;Allemagne, notre plateforme p&eacute;trochimique de Carling ̶ Saint-Avold a pour ambition de devenir le centre europ&eacute;en des r&eacute;sines d&rsquo;hydrocarbures du Groupe et un site leader pour les polym&egrave;res en Europe. D&rsquo;ici 2016, nous aurons investi 160 millions d&rsquo;euros afin d&rsquo;adapter Carling &agrave; l&rsquo;&eacute;volution de la demande europ&eacute;enne et de restaurer sa comp&eacute;titivit&eacute;́.</p>\r\n<p>Dans cette transition, nous accompagnons nos collaborateurs et les entreprises partenaires. Ce projet n&rsquo;implique ni licenciement ni mobilit&eacute;́ forc&eacute;e, et nous recherchons pour chacun de nos collaborateurs une solution adapt&eacute;e. Chez Total, nous sommes tr&egrave;s attach&eacute;s &agrave; maintenir un ancrage industriel fort et p&eacute;renne dans nos r&eacute;gions d&rsquo;implantation, en capitalisant sur les comp&eacute;tences et le savoir-faire de nos &eacute;quipes.</p>\r\n<p><strong>Reconversion du site des Flandres : engagements tenus</strong></p>\r\n<p>Le raffinage europ&eacute;en est confront&eacute; &agrave; une baisse structurelle et durable de la consommation de produits p&eacute;troliers. C&rsquo;est ce qui nous conduit &agrave; prendre les d&eacute;cisions qui s&rsquo;imposent comme arr&ecirc;ter les activit&eacute;s de raffinage de notre site de Dunkerque en France.</p>\r\n<p>L&rsquo;&eacute;tablissement des Flandres abrite d&eacute;sormais trois nouvelles structures :</p>\r\n<ul>\r\n<li>un d&eacute;p&ocirc;t p&eacute;trolier strat&eacute;gique pour la C&ocirc;te d&rsquo;Opale (DPCO) ;</li>\r\n<li>le centre de formation Ol&eacute;um, qui forme des techniciens et op&eacute;rateurs sur des installations r&eacute;elles. Il s&rsquo;agit de la premi&egrave;re &eacute;cole de formation aux m&eacute;tiers du raffinage au monde ;</li>\r\n<li>le centre d&rsquo;assistance technique ATCO, qui fournit une assistance de terrain aux autres raffineries du Groupe.</li>\r\n</ul>\r\n<p>Dans tous les cas, nous avons form&eacute; les salari&eacute;s &agrave; leurs nouveaux m&eacute;tiers et ce sont aujourd&rsquo;hui plus de 200 personnes qui travaillent sur le site.</p>\r\n<p>Fin 2016, l&rsquo;&eacute;tablissement des Flandres accueillera &eacute;galement BioTfueL, une usine pilote de production de biogazole et de biok&eacute;ros&egrave;ne de 2e g&eacute;n&eacute;ration. EcoPhos, une usine belge de phosphate alimentaire devrait &eacute;galement s\'y implanter.&nbsp;</p>\r\n<p>Cette politique sociale s&rsquo;est doubl&eacute;e d&rsquo;un engagement durable aupr&egrave;s de la r&eacute;gion :</p>\r\n<ul>\r\n<li>investissements et aides financi&egrave;res aux entreprises dans le bassin d&rsquo;activit&eacute; du Dunkerquois ;</li>\r\n<li>cr&eacute;ation d&rsquo;un terminal m&eacute;thanier en collaboration avec EDF et Fluxys ;</li>\r\n<li>cr&eacute;ation d&rsquo;une plateforme industrielle afin de redynamiser la r&eacute;gion ;&nbsp;</li>\r\n<li>un partenariat avec la Chambre de Commerce et d&rsquo;Industrie pour accompagner les entreprises locales dans le d&eacute;veloppement des comp&eacute;tences de leurs salari&eacute;s.</li>\r\n</ul>\r\n<p><em>Pour en savoir plus, rendez-vous sur <a href=\"https://www.total.com/fr/expertise-energies/transformation-valorisation/raffinage-petrochimie/acteur-industriel-responsable\" target=\"_blank\" rel=\"noopener noreferrer\">www.total.com</a>.</em></p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-08 11:16:01','2019-04-08 11:16:01'),
