	(96,53,'text','<h1>Pour d&eacute;couvrir cette version digitale,</h1>\r\n<h1>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"https://www.total.com/fr/expertise-energies/transformation-valorisation/raffinage-petrochimie/au-coeur-de-la-machine\" target=\"_blank\" rel=\"noopener noreferrer\"> cliquez ici </a></h1>',NULL,NULL,'youtube',NULL,NULL,1,'2019-04-08 11:30:21','2019-04-08 11:30:21'),
	(97,54,'text','<p><strong>Total est l&rsquo;un des 10 plus grands industriels int&eacute;gr&eacute;s au monde dans la transformation des hydrocarbures, avec notamment la superstructure d&rsquo;Anvers, notre plus grande plateforme europ&eacute;enne de raffinage et de p&eacute;trochimie. Pour r&eacute;pondre &agrave; la demande mondiale croissante et &agrave; l&rsquo;&eacute;volution des march&eacute;s, nous avons modernis&eacute; et adapt&eacute; notre site en orientant sa production vers des produits &agrave; plus forte valeur ajout&eacute;e, r&eacute;pondant aux normes environnementales les plus strictes. L&rsquo;objectif&nbsp;: faire de la plateforme l&rsquo;une des plus performantes de l&rsquo;industrie.</strong></p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-09 11:30:53','2019-04-09 11:30:53'),
	(98,54,'image',NULL,NULL,'wrYW17NK26YgBdSalWEs55JAweEeQm9BsfHVBPYJ.jpeg','youtube',NULL,NULL,1,'2019-04-09 11:30:53','2019-04-09 11:36:33'),
	(99,54,'text','<p><strong>Une plateforme int&eacute;gr&eacute;e des plus performantes</strong></p>\r\n<p>La plateforme d&rsquo;Anvers est situ&eacute;e dans la zone ARA (Anvers-Rotterdam-Amsterdam), extr&ecirc;mement dynamique en termes de march&eacute;s p&eacute;troliers et id&eacute;alement situ&eacute;e dans le port d&rsquo;Anvers, au c&oelig;ur du march&eacute; europ&eacute;en. Elle est constitu&eacute;e d&rsquo;une raffinerie (338 000 b/j) - la troisi&egrave;me plus grande en Europe - d&rsquo;un complexe p&eacute;trochimique et d&rsquo;un site de production de polym&egrave;res (1,1 million de tonnes par an d&rsquo;&eacute;thyl&egrave;ne).&nbsp;<br />&nbsp;<br />La plateforme d&rsquo;Anvers emploie pr&egrave;s de 1 700 collaborateurs qui &oelig;uvrent &agrave; la production de divers produits p&eacute;troliers (fioul lourd, essence, GPL, diesel, k&eacute;ros&egrave;ne&hellip;) et de produits chimiques de base (ol&eacute;fines, fractions C4 - une d&eacute;clinaison du butane- et hydrocarbures aromatiques) dont certains sont transform&eacute;s en polym&egrave;res (poly&eacute;thyl&egrave;ne haute densit&eacute;). Ces produits sont utilis&eacute;s pour de nombreuses applications domestiques et industrielles, par exemple pour les emballages ou dans le secteur automobile.</p>\r\n<p><strong>Une modernisation &agrave; grande &eacute;chelle</strong></p>\r\n<p>Le march&eacute; europ&eacute;en est en pleine &eacute;volution. La demande en fuel lourd baisse, la part du diesel dans les carburants tend &agrave; l&eacute;g&egrave;rement augmenter, et les r&eacute;glementations imposent des taux de soufre toujours plus bas. Pour faire face &agrave; ces d&eacute;fis, nous avons d&eacute;cid&eacute; en 2013 d&rsquo;investir plus d&rsquo;un milliard d&rsquo;euros pour moderniser notre plateforme d&rsquo;Anvers.&nbsp;<br />&nbsp;<br />Nos objectifs : produire plus de produits l&eacute;gers demand&eacute;s par le march&eacute; et r&eacute;pondant aux normes environnementales les plus strictes, flexibiliser la plateforme pour lui permettre d&rsquo;utiliser les charges les plus comp&eacute;titives du march&eacute; et accro&icirc;tre les synergies raffinage-p&eacute;trochimie.&nbsp;<br />&nbsp;<br />Cette modernisation, inaugur&eacute;e en novembre 2017, s&rsquo;est effectu&eacute;e en trois volets :</p>\r\n<ul>\r\n<li>OPTARA (OPTimization of the Antwerp-Rotterdam-Amsterdam area) : modernisation de l&rsquo;unit&eacute; ARDS (Atmospheric Residue Desulfurization) incluant l&rsquo;augmentation de la capacit&eacute; d&rsquo;un de ses trains et la conversion de l&rsquo;autre en mildhydrocracker. Construction d&rsquo;une nouvelle unit&eacute; de d&eacute;sasphaltage et d&rsquo;un nouveau train de distillation pour l&rsquo;hydrocracker. L&rsquo;objectif : transformer plus de fuel lourd en produits l&eacute;gers aux nouvelles sp&eacute;cifications europ&eacute;ennes.</li>\r\n<li>ROG (Refinery Off-gas Project): construction d&rsquo;une unit&eacute; permettant de r&eacute;cup&eacute;rer les gaz co-produits par la raffinerie (&laquo; gaz fatals &raquo;) et de les transformer en mati&egrave;re premi&egrave;re pour la p&eacute;trochimie, en remplacement du naphta, plus co&ucirc;teux.&nbsp;</li>\r\n<li>Projet Ethane : modification d&rsquo;un des deux vapocraqueurs de la plateforme et adaptation de la logistique du site afin qu&rsquo;il puisse importer 200 000 tonnes d&rsquo;&eacute;thane/an de Norv&egrave;ge par bateau. Avec ce projet, le vapocraqueur b&eacute;n&eacute;ficie d&rsquo;une meilleure flexibilit&eacute; d&rsquo;approvisionnement entre &eacute;thane, butane et naphta : les charges avantag&eacute;es pourront repr&eacute;senter plus de 50 % des mati&egrave;res premi&egrave;res utilis&eacute;es.</li>\r\n</ul>',NULL,NULL,'youtube',NULL,NULL,2,'2019-04-09 11:30:53','2019-04-09 11:30:53'),
	(100,54,'quote','<p>Ce projet illustre la strat&eacute;gie de Total de moderniser ses grandes plateformes int&eacute;gr&eacute;es comme celle d&rsquo;Anvers et de d&eacute;velopper sa p&eacute;trochimie &agrave; partir de mati&egrave;res premi&egrave;res avantag&eacute;es, &agrave; l&rsquo;instar des investissements annonc&eacute;s aux &Eacute;tats-Unis et en Cor&eacute;e.</p>','Bernard Pinatel, Directeur-général Raffinage-Chimie de Total',NULL,'youtube',NULL,NULL,3,'2019-04-09 11:30:53','2019-04-09 11:30:53'),
	(101,54,'video',NULL,NULL,NULL,'damdy','https://total-mc33-front-pad.damdy.com/player-html5-e3a39bd8176844589b091035c0c8f321.html',NULL,4,'2019-04-09 11:30:53','2019-04-09 11:30:53'),
	(102,55,'image',NULL,NULL,'sP9u6IrIC4kkdeQ05kl02ifs3YSmbHsHeAIgzaA9.jpeg','youtube',NULL,NULL,0,'2019-04-09 11:46:21','2019-04-09 11:46:21'),
	(103,55,'text','<p><strong>En Cor&eacute;e du Sud, notre Groupe et Hanwha sont partenaires sur la plateforme int&eacute;gr&eacute;e de raffinage-p&eacute;trochimie de Daesan au sein de la joint venture Hanwha Total Petrochemical, qu&rsquo;ils d&eacute;tiennent &agrave; parts &eacute;gales. Des investissements significatifs ont &eacute;t&eacute; d&eacute;cid&eacute;s en 2017 par Total et Hanwha, pour poursuivre le d&eacute;veloppement de cette plateforme majeure.</strong></p>\r\n<p>Situ&eacute;e en Cor&eacute;e du Sud, la plateforme de raffinage-p&eacute;trochimie de Daesan, nous permet de b&eacute;n&eacute;ficier d&rsquo;une position strat&eacute;gique en Asie. Gr&acirc;ce &agrave; un investissement de pr&egrave;s de deux milliards de dollars achev&eacute; fin 2014, elle a doubl&eacute; sa production pour r&eacute;pondre &agrave; la forte croissance de la demande asiatique, et notamment chinoise, en plastiques.</p>\r\n<p>D&rsquo;ici mi 2019, un projet d&rsquo;extension permettra d&rsquo;augmenter la capacit&eacute; de production d&rsquo;&eacute;thyl&egrave;ne du site de 30 %. Cette extension accro&icirc;tra aussi la flexibilit&eacute; de la plateforme, en lui permettant de traiter du propane, mati&egrave;re premi&egrave;re bon march&eacute; car disponible en abondance depuis la r&eacute;volution des gaz de schiste aux Etats Unis.</p>\r\n<p>Un nouvel investissement annonc&eacute; en d&eacute;cembre 2017 permettra en outre d&rsquo;augmenter la capacit&eacute; de production de poly&eacute;thyl&egrave;ne de 50 %, pour atteindre 1,1 million de tonnes par an d&rsquo;ici fin 2019.&nbsp;</p>\r\n<p>La technologie utilis&eacute;e &ndash; Advanced Double Loop, sous licence Total et Chevron Philips Chemical Company - est une technologie de pointe, qui permettra de fournir des polym&egrave;res &agrave; haute valeur ajout&eacute;e au march&eacute; asiatique en croissance.&nbsp;</p>\r\n<p>Le site de Daesan fabrique des produits p&eacute;troliers (k&eacute;ros&egrave;ne, gasoil, essence), ainsi que du polypropyl&egrave;ne, du poly&eacute;thyl&egrave;ne, du styr&egrave;ne, du paraxyl&egrave;ne et de l&rsquo;EVA (Ethylene-vinyl acetate copolymer). Autant de mol&eacute;cules entrant dans la composition de nombreux produits du quotidien.</p>\r\n<p>Le site de Daesan alimente &eacute;galement en styr&egrave;ne l&rsquo;usine p&eacute;trochimique chinoise de Total &agrave; Foshan, qui fabrique chaque ann&eacute;e 200 000 tonnes de polystyr&egrave;ne.</p>',NULL,NULL,'youtube',NULL,NULL,1,'2019-04-09 11:46:21','2019-04-09 11:46:21'),
	(104,56,'text','<p><strong>Situ&eacute;e au Texas, &agrave; proximit&eacute; du Golfe du Mexique, Port Arthur est l&rsquo;une de nos plus grandes plateformes de raffinage-p&eacute;trochimie. Afin de changer la dimension de nos activit&eacute;s p&eacute;trochimiques aux &Eacute;tats-Unis et de monter en puissance sur le plan commercial, nous avons a investi en 2017 pour augmenter significativement notre capacit&eacute; de production d&rsquo;&eacute;thyl&egrave;ne en profitant de l&rsquo;&eacute;thane am&eacute;ricain, abondant et bon march&eacute;.</strong></p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-09 11:56:22','2019-04-09 11:56:22'),
	(105,56,'image',NULL,NULL,'mCiwrLmoqJyPAFc1Cxfi0KK2jpP6tJTfQ5lLLIXU.jpeg','youtube',NULL,NULL,1,'2019-04-09 11:56:23','2019-04-09 11:56:23'),
	(106,56,'text','<p><strong>Une pr&eacute;sence majeure dans le raffinage et la p&eacute;trochimie aux &Eacute;tats-unis</strong></p>\r\n<p>Pour conduire ses activit&eacute;s de raffinage, notre site de Port Arthur dispose d&rsquo;une capacit&eacute; de production de 185&nbsp;000&nbsp;barils par jour.</p>\r\n<p>Gr&acirc;ce au programme de modernisation r&eacute;alis&eacute; en 2011 et au rattachement de la raffinerie au r&eacute;seau de pipeline domestique am&eacute;ricain, Port Arthur b&eacute;n&eacute;ficie d&rsquo;une grande flexibilit&eacute; lui permettant de s&rsquo;adapter &agrave; l&rsquo;&eacute;volution du march&eacute;. La raffinerie traite majoritairement des bruts tr&egrave;s lourds, difficiles &agrave; traiter (notamment du Canada ou d&rsquo;Am&eacute;rique Latine) mais aussi des bruts l&eacute;gers issus de la production locale. Sa configuration vise &agrave; produire le plus possible de produits l&eacute;gers &ndash; essences, gazole, k&eacute;roz&egrave;ne - &agrave; forte valeur ajout&eacute;e.</p>\r\n<p>C&ocirc;t&eacute; p&eacute;trochimie, nous disposons sur la plateforme de Port Arthur d&rsquo;un vapocraqueur de 1&nbsp;million de tonnes en co-entreprise avec BASF. &Agrave; la suite d&rsquo;adaptations r&eacute;alis&eacute;es depuis 2013, il fonctionne d&eacute;sormais principalement sur base &eacute;thane et butane produits localement. Nous sommes &eacute;galement pr&eacute;sents sur le march&eacute; am&eacute;ricain des polym&egrave;res via notre usine de poly&eacute;thyl&egrave;ne de Bayport, notre usine de polypropyl&egrave;ne &agrave; La Porte et notre usine de styr&egrave;ne-polystyr&egrave;ne &agrave; Carville.</p>\r\n<p><strong>Une nouvelle dimension pour nos activit&eacute;s p&eacute;trochimiques</strong></p>\r\n<p>Total a lanc&eacute; de nouveaux projets d&rsquo;investissements aux &Eacute;tats-Unis et s&rsquo;est associ&eacute; &agrave; NOVA Chemicals et Borealis dans la joint-venture Bayport &ndash; Polymers (Total Petrochemicals x%x Refining USA, Inc. 50 % - Novealis 50 %* ). Le projet vise &agrave; construire un vapocraqueur sur base &eacute;thane de taille mondiale sur la plateforme int&eacute;gr&eacute;e de Port Arthur, ainsi qu&rsquo;une nouvelle unit&eacute; de poly&eacute;thyl&egrave;ne sur l&rsquo;usine de Bayport. D&rsquo;une capacit&eacute; d&rsquo;1&nbsp;million de tonnes d&rsquo;&eacute;thyl&egrave;ne/an, le vapocraqueur repr&eacute;sente un investissement d&rsquo;1,7&nbsp;milliard de dollars et devrait d&eacute;marrer fin 2020. Il a &eacute;t&eacute; con&ccedil;u pour maximiser les synergies avec la plateforme de Port Arthur. Sa production alimentera le site de Bayport, qui, avec une capacit&eacute; de production d&rsquo;1&nbsp;million de tonnes de poly&eacute;thyl&egrave;ne par an, deviendra un site de taille mondiale.</p>\r\n<p>Avec ce partenariat, notre ambition est d&rsquo;&ecirc;tre totalement int&eacute;gr&eacute; sur la cha&icirc;ne de l&rsquo;&eacute;thyl&egrave;ne et l&rsquo;un des premiers acteurs sur le march&eacute; du poly&eacute;thyl&egrave;ne aux &Eacute;tats-Unis.</p>\r\n<p>*&nbsp;Borealis et NOVA Chemicals ont cr&eacute;&eacute; la joint venture Novealis Holdings LLC pour s&rsquo;associer avec Total dans la JV Bayport-Polymers.</p>',NULL,NULL,'youtube',NULL,NULL,2,'2019-04-09 11:56:23','2019-04-09 11:56:23'),
	(107,57,'text','<p><strong>Pour Total, le Qatar est de longue date un pays-cl&eacute;, de par ses ressources en gaz et sa proximit&eacute; avec les march&eacute;s asiatiques en croissance. Du gaz aux polym&egrave;res, Total y est pr&eacute;sent &agrave; tous les niveaux de la cha&icirc;ne de production et nous occupons une position majeure dans le secteur p&eacute;trochimie de ce pays, &agrave; travers une participation dans deux joint-ventures (Qapco et Qatofin). Enfin, nous d&eacute;tenons des parts dans deux raffineries de condensats (Ras Laffan&nbsp;1 et Ras Laffan 2) qui traitent les p&eacute;troles l&eacute;gers associ&eacute;s &agrave; la production de gaz.</strong></p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-09 12:00:05','2019-04-09 12:00:05'),
	(108,57,'image',NULL,NULL,'MazpF99L3DlCLsHIY7TAs9IwlVQg2szODWJPFYtT.jpeg','youtube',NULL,NULL,1,'2019-04-09 12:00:05','2019-04-09 12:00:05'),
	(109,57,'text','<p>Pr&eacute;sents depuis 1974, nous d&eacute;tenons au Qatar des participations dans plusieurs activit&eacute;s dont la raffinerie de condensats de Ras&nbsp;Laffan, la joint-venture Qapco qui op&egrave;re notamment un vapocraqueur sur base &eacute;thane et des lignes de poly&eacute;thyl&egrave;ne basse densit&eacute; et enfin la joint-venture Qatofin, qui d&eacute;tient un vapocraqueur fonctionnant &agrave; l&rsquo;&eacute;thane, un pipeline de 128&nbsp;km reliant Ras&nbsp;Laffan &agrave; Mesaieed et une unit&eacute; de poly&eacute;thyl&egrave;ne basse densit&eacute; lin&eacute;aire.</p>',NULL,NULL,'youtube',NULL,NULL,2,'2019-04-09 12:00:05','2019-04-09 12:00:05'),
	(110,58,'text','<p><strong>Situ&eacute;e dans le nord-ouest de la France, la plateforme Normandie transforme chaque ann&eacute;e pr&egrave;s de 12 millions de tonnes de p&eacute;trole brut en quelque 200 produits : essence, gazole, k&eacute;ros&egrave;ne, huiles lubrifiants et granul&eacute;s de plastique. Un investissement d&rsquo;un milliard d&rsquo;euros lui a permis d&rsquo;adapter sa production &agrave; l&rsquo;&eacute;volution de la demande et d&rsquo;am&eacute;liorer sa performance &eacute;nerg&eacute;tique. La plateforme de Normandie compte aujourd&rsquo;hui parmi nos plus grandes plateformes int&eacute;gr&eacute;es de raffinage-p&eacute;trochimie au monde.</strong></p>\r\n<p>&nbsp;</p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-09 12:05:44','2021-06-29 18:00:56'),
	(111,58,'image',NULL,NULL,'IG6n8qQ2WgeT7imGvaNBQBZSEf7bXu0roHbSTDfs.jpeg','youtube',NULL,NULL,1,'2019-04-09 12:05:45','2019-04-09 12:05:45'),
	(112,58,'text','<p>Fer de lance de nos activit&eacute;s de raffinage et de p&eacute;trochimie en France, la plateforme, compos&eacute;e d&rsquo;une raffinerie et d&rsquo;une usine p&eacute;trochimique, a r&eacute;cemment b&eacute;n&eacute;fici&eacute; d&rsquo;un plan de modernisation. Notre Groupe a investi un milliard d&rsquo;euros afin d&rsquo;am&eacute;liorer l&rsquo;efficacit&eacute; des deux sites et de renforcer leurs synergies. Cette modernisation a &eacute;galement permis de r&eacute;duire la consommation d\'&eacute;nergie et d\'eau des deux sites et de limiter les &eacute;missions atmosph&eacute;riques, afin de r&eacute;duire l&rsquo;impact environnemental de la plateforme.</p>\r\n<p>Aujourd&rsquo;hui, la production de la raffinerie repr&eacute;sente 12% de la capacit&eacute; de raffinage en France. Les travaux r&eacute;alis&eacute;s ont permis d&rsquo;adapter la production du site &agrave; l&rsquo;&eacute;volution des march&eacute;s. C&ocirc;t&eacute; p&eacute;trochimie, la production de l&rsquo;usine repr&eacute;sente 11% des plastiques produits en France. La plateforme exp&eacute;die ses produits dans plus de 60 pays dans le monde.</p>',NULL,NULL,'youtube',NULL,NULL,2,'2019-04-09 12:05:45','2019-04-09 12:05:45'),
	(113,59,'text','<p><strong>Fruit de l&rsquo;alliance des savoir-faire de Saudi Aramco et de notre Groupe, SATORP est l&rsquo;une des plateformes int&eacute;gr&eacute;es de raffinage et de p&eacute;trochimie les plus performantes au monde. Sa mission : transformer un p&eacute;trole brut lourd en produits raffin&eacute;s &agrave; haute valeur ajout&eacute;e.</strong></p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-09 12:10:10','2019-04-09 12:10:10'),
	(114,59,'image',NULL,NULL,'QXSYRLekyvKnbTEib87QnQ2yTn42YPBY67jfTfjG.jpeg','youtube',NULL,NULL,1,'2019-04-09 12:10:11','2019-04-09 12:10:11'),
	(115,59,'text','<p>Fruit de l&rsquo;alliance des savoir-faire de Saudi Aramco et de notre Groupe, SATORP est l&rsquo;une des plateformes int&eacute;gr&eacute;es de raffinage et de p&eacute;trochimie les plus performantes au monde. Sa mission : transformer un p&eacute;trole brut lourd en produits raffin&eacute;s &agrave; haute valeur ajout&eacute;e.<br />Op&eacute;rationnelle depuis 2014, SATORP est l&rsquo;une des plus grandes plateformes de raffinage et de p&eacute;trochimie au monde, mais elle est surtout l&rsquo;une des plus complexes et performantes. Elle est capable de transformer du p&eacute;trole brut lourd et soufr&eacute;, donc difficile &agrave; traiter, en produits raffin&eacute;s &agrave; haute valeur ajout&eacute;e. Pour ce faire, elle s&rsquo;appuie sur un panel complet d&rsquo;unit&eacute;s de traitement :</p>\r\n<ul>\r\n<li>2 hydrocraqueurs de distillats qui convertissent les fractions lourdes de p&eacute;trole en produits plus l&eacute;gers et &agrave; tr&egrave;s basse teneur en soufre ;</li>\r\n<li>1 unit&eacute; de craquage catalytique permettant d\'obtenir des produits vari&eacute;s, dont des hydrocarbures tr&egrave;s l&eacute;gers comme du propyl&egrave;ne et du gaz de p&eacute;trole liqu&eacute;fi&eacute; (GPL) ;</li>\r\n<li>1 unit&eacute; de cok&eacute;faction, un proc&eacute;d&eacute; thermique permettant de transformer les fractions lourdes en produits p&eacute;troliers l&eacute;gers, ainsi qu&rsquo;en coke.</li>\r\n</ul>\r\n<p>D&eacute;but 2018, la capacit&eacute; de production de la plateforme de SATORP a &eacute;t&eacute; port&eacute;e &agrave; 440 000 barils de p&eacute;trole brut par jour, pour produire environ 22 millions de tonnes par an de produits p&eacute;troliers raffin&eacute;s, dont 700 000 tonnes de paraxyl&egrave;ne, 150 000 tonnes de benz&egrave;ne et 200 000 tonnes de propyl&egrave;ne de haute puret&eacute;. Par ailleurs, les &eacute;quipes de Total et de Saudi Aramco poursuivent des &eacute;tudes de d&eacute;veloppement d&rsquo;autres unit&eacute;s p&eacute;trochimiques en aval de cette plateforme.</p>',NULL,NULL,'youtube',NULL,NULL,2,'2019-04-09 12:10:11','2019-04-09 12:10:11'),
	(116,60,'text','<p><strong>Nous sommes un acteur industriel majeur en Europe et cette position nous conf&egrave;re une responsabilit&eacute; dans notre secteur d&rsquo;activit&eacute;. Pour accompagner la mutation profonde du raffinage-p&eacute;trochimie, il nous revient d&rsquo;anticiper et de nous adapter aux nouvelles exigences du march&eacute; dans le cadre d&rsquo;une d&eacute;marche sociale responsable.</strong></p>\r\n<p><strong>Une d&eacute;marche soci&eacute;tale innovante pour anticiper l&rsquo;avenir de nos sites</strong></p>\r\n<p>Le march&eacute;́ europ&eacute;en est marqué par une baisse durable de la consommation de produits p&eacute;troliers ainsi que par des d&eacute;s&eacute;quilibres significatifs entre la demande et l&rsquo;offre. Pour y faire face, nous avons r&eacute;duit nos capacit&eacute;s de raffinage et r&eacute;alis&eacute; des adaptations industrielles de grande ampleur. C&rsquo;est la condition absolue pour assurer un avenir p&eacute;renne &agrave; nos sites.</p>\r\n<p>La r&eacute;ussite de cette transition repose sur l&rsquo;anticipation et l&rsquo;implication de toutes les parties prenantes. Notre d&eacute;marche d&rsquo;acteur responsable repose avant tout sur la concertation. Nous nous attachons aussi &agrave; maintenir dans l&rsquo;emploi nos collaborateurs en tenant compte de leurs comp&eacute;tences sp&eacute;cifiques.</p>\r\n<p>Nous sommes &eacute;galement un partenaire &eacute;conomique majeur des r&eacute;gions dans lesquelles nous sommes implant&eacute;s. Nous contribuons &agrave; leur d&eacute;veloppement social, &eacute;conomique et environnemental. Ainsi, nous menons des actions volontaires de d&eacute;veloppement &eacute;conomique en partenariat avec les collectivit&eacute;s locales et l&rsquo;&Eacute;tat.</p>\r\n<p><strong>La transition industrielle de Carling : une d&eacute;marche responsable</strong></p>\r\n<p>Situ&eacute;e dans le d&eacute;partement fran&ccedil;ais de la Moselle, &agrave; la fronti&egrave;re avec l&rsquo;Allemagne, notre plateforme p&eacute;trochimique de Carling ̶ Saint-Avold a pour ambition de devenir le centre europ&eacute;en des r&eacute;sines d&rsquo;hydrocarbures du Groupe et un site leader pour les polym&egrave;res en Europe. D&rsquo;ici 2016, nous aurons investi 160 millions d&rsquo;euros afin d&rsquo;adapter Carling &agrave; l&rsquo;&eacute;volution de la demande europ&eacute;enne et de restaurer sa comp&eacute;titivit&eacute;́.</p>\r\n<p>Dans cette transition, nous accompagnons nos collaborateurs et les entreprises partenaires. Ce projet n&rsquo;implique ni licenciement ni mobilit&eacute;́ forc&eacute;e, et nous recherchons pour chacun de nos collaborateurs une solution adapt&eacute;e. Chez Total, nous sommes tr&egrave;s attach&eacute;s &agrave; maintenir un ancrage industriel fort et p&eacute;renne dans nos r&eacute;gions d&rsquo;implantation, en capitalisant sur les comp&eacute;tences et le savoir-faire de nos &eacute;quipes.</p>\r\n<p><strong>Reconversion du site des Flandres : engagements tenus</strong></p>\r\n<p>Le raffinage europ&eacute;en est confront&eacute; &agrave; une baisse structurelle et durable de la consommation de produits p&eacute;troliers. C&rsquo;est ce qui nous conduit &agrave; prendre les d&eacute;cisions qui s&rsquo;imposent comme arr&ecirc;ter les activit&eacute;s de raffinage de notre site de Dunkerque en France.</p>\r\n<p>L&rsquo;&eacute;tablissement des Flandres abrite d&eacute;sormais trois nouvelles structures :</p>\r\n<ul>\r\n<li>un d&eacute;p&ocirc;t p&eacute;trolier strat&eacute;gique pour la C&ocirc;te d&rsquo;Opale (DPCO) ;</li>\r\n<li>le centre de formation Ol&eacute;um, qui forme des techniciens et op&eacute;rateurs sur des installations r&eacute;elles. Il s&rsquo;agit de la premi&egrave;re &eacute;cole de formation aux m&eacute;tiers du raffinage au monde ;</li>\r\n<li>le centre d&rsquo;assistance technique ATCO, qui fournit une assistance de terrain aux autres raffineries du Groupe.</li>\r\n</ul>\r\n<p>Dans tous les cas, nous avons form&eacute; les salari&eacute;s &agrave; leurs nouveaux m&eacute;tiers et ce sont aujourd&rsquo;hui plus de 200 personnes qui travaillent sur le site.</p>\r\n<p>Fin 2016, l&rsquo;&eacute;tablissement des Flandres accueillera &eacute;galement BioTfueL, une usine pilote de production de biogazole et de biok&eacute;ros&egrave;ne de 2e g&eacute;n&eacute;ration. EcoPhos, une usine belge de phosphate alimentaire devrait &eacute;galement s\'y implanter.&nbsp;</p>\r\n<p>Cette politique sociale s&rsquo;est doubl&eacute;e d&rsquo;un engagement durable aupr&egrave;s de la r&eacute;gion :</p>\r\n<ul>\r\n<li>investissements et aides financi&egrave;res aux entreprises dans le bassin d&rsquo;activit&eacute; du Dunkerquois ;</li>\r\n<li>cr&eacute;ation d&rsquo;un terminal m&eacute;thanier en collaboration avec EDF et Fluxys ;</li>\r\n<li>cr&eacute;ation d&rsquo;une plateforme industrielle afin de redynamiser la r&eacute;gion ;&nbsp;</li>\r\n<li>un partenariat avec la Chambre de Commerce et d&rsquo;Industrie pour accompagner les entreprises locales dans le d&eacute;veloppement des comp&eacute;tences de leurs salari&eacute;s.</li>\r\n</ul>\r\n<p><em>Pour en savoir plus, rendez-vous sur <a href=\"https://www.total.com/fr/expertise-energies/transformation-valorisation/raffinage-petrochimie/acteur-industriel-responsable\" target=\"_blank\" rel=\"noopener noreferrer\">www.total.com</a>.</em></p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-09 14:26:01','2019-04-09 14:26:01'),
	(117,61,'text','<p><strong>Notre vocation est d\'&ecirc;tre un partenaire de choix du secteur aval p&eacute;trolier pour collaborer aux projets industriels qui se dessinent et se r&eacute;alisent partout dans le monde. Pour cela, nous apportons notre savoir-faire et notre approche int&eacute;gr&eacute;e dans le domaine de l&rsquo;&eacute;nergie. Notre capacit&eacute; d&rsquo;adaptation et nos succ&egrave;s dans les relations interculturelles sont aussi notre fiert&eacute; et un atout pour convaincre nos parties prenantes.</strong></p>\r\n<p><strong>Une exp&eacute;rience reconnue dans la gestion de grands projets</strong></p>\r\n<p>Pr&eacute;sents sur plusieurs continents, nous g&eacute;rons de grands complexes depuis de nombreuses ann&eacute;es. C&rsquo;est cette exp&eacute;rience qui nous permet aujourd&rsquo;hui de nouer des collaborations durables avec nos partenaires.&nbsp;<br />Nous mettons &agrave; leur disposition nos principaux atouts :</p>\r\n<ul>\r\n<li>expertise technique ;</li>\r\n<li>respect des d&eacute;lais et des budgets, v&eacute;ritable gage de confiance ;</li>\r\n<li>savoir-faire manag&eacute;rial interculturel fond&eacute; sur l&rsquo;&eacute;change, un &eacute;l&eacute;ment f&eacute;d&eacute;rateur pour les diff&eacute;rentes nationalit&eacute;s qui peuvent composer les &eacute;quipes ;</li>\r\n<li>capacit&eacute;s de financement d&rsquo;un grand groupe international.</li>\r\n</ul>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-09 14:31:14','2019-04-09 14:31:14'),
	(118,61,'quote','<p>SATORP est le r&eacute;sultat d&rsquo;un solide partenariat entre Total et Saudi Aramco et de leur d&eacute;termination &agrave; construire ensemble l\'une des raffineries les plus complexes et les plus performantes au monde.</p>','Fawwaz I. Nawwab, président-directeur Général de SATORP',NULL,'youtube',NULL,NULL,1,'2019-04-09 14:31:14','2019-04-09 14:31:14'),
	(119,61,'text','<p><strong>La force d&rsquo;un Groupe int&eacute;gr&eacute; sur l&rsquo;ensemble de la cha&icirc;ne de valeur</strong></p>\r\n<p>Nos activit&eacute;s de raffinage-p&eacute;trochimie sont int&eacute;gr&eacute;es aux autres activit&eacute;s du Groupe, de l&rsquo;exploration-production de p&eacute;trole et de gaz jusqu&rsquo;&agrave; la distribution de produits p&eacute;troliers. C&rsquo;est pour nos partenaires, comme pour nous, un facteur de diff&eacute;renciation d&eacute;terminant.</p>\r\n<p>La coop&eacute;ration avec nos activit&eacute;s d\'exploration et de production de p&eacute;trole et de gaz nous permet d&rsquo;accompagner nos partenaires dans la valorisation de leurs ressources et le d&eacute;veloppement de leurs industries. Notre vaste r&eacute;seau de distribution de gros comme de d&eacute;tail, garantit le d&eacute;bouch&eacute; de nos productions et celles de nos partenaires. Nos activit&eacute;s de n&eacute;goce et de transport s&eacute;curisent, quant &agrave; elles, l&rsquo;approvisionnement de nos plateformes.</p>',NULL,NULL,'youtube',NULL,NULL,2,'2019-04-09 14:31:14','2019-04-09 14:31:14'),
	(120,61,'image',NULL,NULL,'nPi4fSAurjz17ZM152nsYKkzAsSJiKwbgltCA5rI.jpeg','youtube',NULL,NULL,3,'2019-04-09 14:31:14','2019-04-09 14:31:14'),
	(121,61,'text','<p><em>Pour en savoir plus, rendez-vous sur: <a href=\"https://www.total.com/fr/expertise-energies/transformation-valorisation/raffinage-petrochimie/partenariats-durables\" target=\"_blank\" rel=\"noopener noreferrer\">www.total.com</a>.</em></p>',NULL,NULL,'youtube',NULL,NULL,4,'2019-04-09 14:31:14','2019-04-09 14:31:14'),
	(122,62,'text','<p><strong>La s&eacute;curit&eacute;&nbsp;est une valeur fondamentale de notre Groupe et&nbsp;le premier&nbsp;crit&egrave;re de notre excellence op&eacute;rationnelle. Elle est au c&oelig;ur de toutes nos activit&eacute;s et le fondement de notre culture industrielle. Une culture de l&rsquo;excellence qui passe &eacute;galement par l&rsquo;am&eacute;lioration continue de l&rsquo;efficacit&eacute; op&eacute;rationnelle et &eacute;nerg&eacute;tique de nos installations.</strong></p>\r\n<p><strong>La s&eacute;curit&eacute; : une valeur fondamentale</strong></p>\r\n<p>Chez Total, la s&eacute;curit&eacute; est une valeur fondamentale et la condition de la p&eacute;rennit&eacute; de nos activit&eacute;s. Nous transformons des produits, les hydrocarbures, qui par leur nature pr&eacute;sentent des risques sp&eacute;cifiques qu&rsquo;il nous appartient de conna&icirc;tre et de ma&icirc;triser. Nous sommes responsables de la s&eacute;curit&eacute; de nos collaborateurs, de nos prestataires et de nos riverains. Pour mettre en place et faire appliquer notre culture s&eacute;curit&eacute;, nous avons formalis&eacute; un certain nombre de r&egrave;gles : nos 12&nbsp;r&egrave;gles d&rsquo;or de la s&eacute;curit&eacute; au poste de travail.</p>\r\n<p><strong>Les synergies raffinage-p&eacute;trochimie pour l&rsquo;efficacit&eacute; op&eacute;rationnelle</strong></p>\r\n<p>Chez Total, le raffinage et la p&eacute;trochimie sont deux activit&eacute;s int&eacute;gr&eacute;es. Leurs proc&eacute;d&eacute;s techniquement proches nous permettent de d&eacute;gager des synergies conduisant &agrave; plus d&rsquo;efficacit&eacute; op&eacute;rationnelle. Sur des sites industriels appel&eacute;s &laquo; plateformes int&eacute;gr&eacute;es &raquo;, nos unit&eacute;s de raffinage et de p&eacute;trochimie sont reli&eacute;es pour faciliter les &eacute;changes de mati&egrave;res premi&egrave;res et le partage de l&rsquo;&eacute;nergie n&eacute;cessaire pour produire. Ce choix strat&eacute;gique nous permet notamment de r&eacute;aliser des &eacute;conomies de fonctionnement pour am&eacute;liorer la comp&eacute;titivit&eacute; de nos sites.</p>\r\n<p><strong>Disponibilit&eacute; : assurer la continuit&eacute; de nos op&eacute;rations</strong></p>\r\n<p>Nos march&eacute;s sont particuli&egrave;rement volatiles et les marges sensibles au prix du p&eacute;trole, aux conditions climatiques ou encore &agrave; la conjoncture &eacute;conomique. La disponibilit&eacute; de notre outil industriel, c&rsquo;est-&agrave;-dire sa capacit&eacute; &agrave; produire en continu, est essentielle pour saisir des opportunit&eacute;s de march&eacute; au moment o&ugrave; elles se pr&eacute;sentent.</p>\r\n<p>Pour am&eacute;liorer notre disponibilit&eacute; moyenne, nous avons mis en place une m&eacute;thodologie industrielle, fond&eacute;e sur les meilleures pratiques du raffinage et de la p&eacute;trochimie. Les gains obtenus nous feront progresser sur tous les sujets op&eacute;rationnels : s&eacute;curit&eacute;, conduite des op&eacute;rations, maintenance, efficacit&eacute; &eacute;nerg&eacute;tique, protection de l&rsquo;environnement.</p>\r\n<p><em>Pour en savoir plus, rendez-vous sur : <a href=\"https://www.total.com/fr/expertise-energies/transformation-valorisation/raffinage-petrochimie/excellence-operationnelle\" target=\"_blank\" rel=\"noopener noreferrer\">www.total.com</a>.</em></p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-09 14:33:19','2019-04-09 14:33:19'),
	(123,63,'text','<p><strong>Le p&eacute;trole et le gaz sont utilis&eacute;s dans de tr&egrave;s nombreux produits du quotidien&nbsp;: carburants, plastiques, r&eacute;sines&hellip; Leurs domaines d&rsquo;applications sont multiples : mobilit&eacute;, &eacute;lectrom&eacute;nager, emballage alimentaire et industriel et bien d&rsquo;autres encore. Servir l&rsquo;ensemble de ces besoins &agrave; travers le monde repr&eacute;sente un v&eacute;ritable d&eacute;fi. C&rsquo;est aussi notre mission.</strong></p>\r\n<p><strong>Asie &amp; Moyen-Orient : servir des march&eacute;s en pleine croissance</strong></p>\r\n<p>L&rsquo;Orient est une zone de d&eacute;veloppement pour nos activit&eacute;s de<span style=\"text-decoration: underline;\"> raffinage et de p&eacute;trochimie</span>. La demande en produits p&eacute;troliers sur les march&eacute;s asiatiques en croissance offre un d&eacute;bouch&eacute; important pour notre production. D&rsquo;autre part, notre pr&eacute;sence au Moyen-Orient nous permet d&rsquo;acc&eacute;der &agrave; des ressources disponibles en quantit&eacute; et plus avantageuses en termes de prix, et de profiter d&rsquo;une position g&eacute;ographique strat&eacute;gique pour servir les march&eacute;s de la zone.</p>\r\n<p>Nous op&eacute;rons dans ces r&eacute;gions deux plateformes de rang mondial, en partenariat avec de grands acteurs locaux.</p>\r\n<p>En Cor&eacute;e&nbsp;du&nbsp;Sud, nous sommes partenaires d\'Hanwha sur notre plateforme de Daesan o&ugrave; nous avons investi pr&egrave;s de deux milliards de dollars afin de doubler la capacit&eacute; du site et diversifier sa production. <br />En Arabie&nbsp;Saoudite, nous sommes partenaires de Saudi&nbsp;Aramco sur la toute r&eacute;cente plateforme de SATORP, la plus grande du Groupe. Elle transforme le brut lourd saoudien en produits &agrave; forte valeur ajout&eacute;e, destin&eacute;s en priorit&eacute; &agrave; l&rsquo;Asie et au Moyen-Orient.</p>\r\n<p><strong>Am&eacute;rique du Nord : la r&eacute;volution des gaz de schiste</strong></p>\r\n<p>L&rsquo;exploitation des gaz de schiste a donn&eacute; un nouveau souffle &agrave; notre activit&eacute; industrielle en Am&eacute;rique du Nord. Notre pr&eacute;sence dans la r&eacute;gion nous permet d&rsquo;acc&eacute;der &agrave; un gaz naturel et p&eacute;trole abondant et donc peu co&ucirc;teux pour alimenter nos usines de production. La raffinerie acc&egrave;de ainsi aux bruts domestiques l&eacute;gers issus des schistes, et le vapocraqueur craque &agrave; plus de 80% de l&rsquo;&eacute;thane et des GPL, qui remplacent le naphta, une ressource plus ch&egrave;re. Pour poursuivre cette strat&eacute;gie,&nbsp; des &eacute;tudes d&rsquo;ing&eacute;nierie pour un nouveau craqueur &eacute;thane ont &eacute;t&eacute; lanc&eacute;es.</p>\r\n<p><strong>Europe : investir pour satisfaire une demande mature</strong></p>\r\n<p>Socle historique de nos activit&eacute;s et de notre savoir-faire, le continent europ&eacute;en concentre la majeure partie de nos installations industrielles. C&rsquo;est un march&eacute; en pleine mutation : baisse de la demande en raison de nouvelles motorisations plus &eacute;conomes en &eacute;nergie, besoin tourn&eacute; vers le diesel en raison d&rsquo;incitation fiscale, r&eacute;glementations toujours plus exigeantes&hellip;</p>\r\n<p>Pour nous adapter &agrave; cette nouvelle donne et rendre nos sites plus comp&eacute;titifs, nous concentrons nos investissements sur nos plateformes int&eacute;gr&eacute;es raffinage-p&eacute;trochimie et sur des activit&eacute;s &agrave; tr&egrave;s haute valeur ajout&eacute;e.</p>\r\n<p>&nbsp;</p>',NULL,NULL,'youtube',NULL,NULL,0,'2019-04-09 14:35:38','2019-04-23 11:54:08'),
