	(133,20,'text','<p><strong>Jours f&eacute;ri&eacute;s - Jours B&eacute;n&eacute;voles 2019</strong> <br /><br />A l&rsquo;occasion des f&ecirc;tes l&eacute;gales et dans le cadre des textes en vigueur &agrave; ce jour, les f&ecirc;tes l&eacute;gales ch&ocirc;m&eacute;es de l&rsquo;ann&eacute;e 2019 seront les suivantes&nbsp;:</p>\r\n<ul>\r\n<li>Mardi 1er janvier &ndash; Jour de l&rsquo;An</li>\r\n<li>Lundi 22 avril &ndash; Lundi de P&acirc;ques</li>\r\n<li>Mercredi 1er mai &ndash; F&ecirc;te du travail</li>\r\n<li>Mercredi 8 mai &ndash; Victoire 1945</li>\r\n<li>Jeudi 30 mai &ndash; F&ecirc;te de l&rsquo;Ascension</li>\r\n<li>Lundi 10 juin &ndash; Lundi de Pentec&ocirc;te</li>\r\n<li>Jeudi 15 ao&ucirc;t &ndash; Assomption</li>\r\n<li>Vendredi 1er novembre &ndash; Toussaint</li>\r\n<li>Lundi 11 novembre &ndash; Armistice</li>\r\n<li>Mercredi 25 d&eacute;cembre &ndash; No&euml;l</li>\r\n</ul>\r\n<p>Les absences au titre des jours b&eacute;n&eacute;voles 2019 <span style=\"text-decoration: underline;\">pour l&rsquo;ensemble du personnel de l&rsquo;&eacute;tablissement</span> (hors rythme 2X8C et 3X8C) seront au nombre <strong>de 2</strong>, pour une pr&eacute;sence sur toute l&rsquo;ann&eacute;e 2019.</p>\r\n<p>Ces jours sont acquis &agrave; raison de 2/12&egrave;me de jour par mois au prorata du temps de pr&eacute;sence et figureront dans WFM et sur le bulletin de paie au fur et &agrave; mesure de l&rsquo;acquisition.</p>\r\n<p>Les jours b&eacute;n&eacute;voles pourront &ecirc;tre exerc&eacute;s aux dates suivantes&nbsp;:</p>\r\n<ul>\r\n<li>Vendredi 21 juin</li>\r\n<li>Vendredi 20 d&eacute;cembre</li>\r\n</ul>\r\n<p>Les salari&eacute;s qui le souhaitent pourront, en accord avec la hi&eacute;rarchie, exercer ces jours &agrave; des dates diff&eacute;rentes.</p>\r\n<p>&nbsp;L&rsquo;&eacute;tablissement restera donc ouvert aux dates indiqu&eacute;es ci-dessus.</p>',NULL,NULL,'youtube',NULL,NULL,7,'2019-04-10 18:54:39','2019-04-10 18:54:39'),
