	(175,106,'text','<p>Bonjour&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Puce 1</li>\r\n<li>Puce 2</li>\r\n</ul>',NULL,NULL,'youtube',NULL,NULL,0,'2021-06-28 16:39:47','2021-06-28 16:39:47'),
	(176,132,'text','<p>The development of biofuels is part of TotalEnergies\' strategy to decarbonize the transport industry.</p>\r\n<p>We already produce Sustainable Aviation Fuel (SAF), made from waste and residues, such as animal fats and used cooking oils, and blended with fossil-based jet fuel.</p>\r\n<p>Of the seven approved pathways for producing SAF, TotalEnergies has decided to focus on HEFA, which:</p>\r\n<ul>\r\n<li>is the only pathway to have reached the commercial stage in the form of drop-in products, i.e. products requiring no changes to existing logistics infrastructures, aircraft or engines</li>\r\n<li>is the most mature and economical</li>\r\n<li>will be used for the future zero-crude platform at Grandpuits</li>\r\n<li>constitutes a new step in TotalEnergies&rsquo; commitment to reduce the carbon intensity of the energy products used by its clients.</li>\r\n</ul>',NULL,NULL,'youtube',NULL,NULL,0,'2021-06-29 18:05:39','2021-06-29 18:05:39'),
	(177,132,'text','<p><em>Retrouvez ce post sur la page LinkedIn <a href=\"https://www.linkedin.com/posts/totalenergiesmobility-solutions_totalenergies-energytransition-activity-6807962274704183296-xA0C\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>TotalEnergies Mobility Solutions</strong></a>. </em></p>',NULL,NULL,'youtube',NULL,NULL,1,'2021-06-29 18:05:39','2021-06-29 18:05:39'),
	(178,133,'text','<p>Did you know?</p>\r\n<p>TotalEnergies is studying the use of CO2 as a feedstock. Once a molecule of CO2 has been captured, there are several paths to valorize it in addition to underground storage.</p>\r\n<p>TotalEnergies&rsquo; R&amp;D is currently focusing on solutions for converting CO2 into e-chemicals or e-fuels. CO2 can also be used in the production of building materials like cement, providing another solution for long-term storage.</p>\r\n<p>This opens a whole new range of CO2-reduction possibilities with strong potential.</p>',NULL,NULL,'youtube',NULL,NULL,0,'2021-06-29 18:10:49','2021-06-29 18:10:49'),
	(179,133,'text','<p><em>Retrouvez ce post sur la page LinkedIn <a href=\"https://www.linkedin.com/posts/totalenergies-industry_totalenergiesindustrysolutions-refiningandchemicals-activity-6808728595247235072-ImKY\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>TotalEnergies Mobility Solutions</strong></a>.</em></p>',NULL,NULL,'youtube',NULL,NULL,1,'2021-06-29 18:10:49','2021-06-29 18:10:49'),
	(180,134,'text','<p>Fully committed to improving the #environmentalimpact of its products, TotalEnergies has joined forces with multinational ice cream manufacturer Froneri Italy and Italian packaging specialist MPG Manifattura Plastica S.p.A. to develop more #sustainable food packaging.</p>\r\n<p>Froneri&rsquo;s iconic ice cream Coppa del Nonno will soon be packaged in #biobasedplastic cups made from TotalEnergies Certified #Renewable polypropylene.</p>\r\n<p>This material guarantees:</p>\r\n<ul>\r\n<li>identical properties to virgin polypropylene from fossil feedstock</li>\r\n<li>lower #carbonfootprint</li>\r\n<li>full #recyclability</li>\r\n</ul>\r\n<p>An innovative collaboration contributing to our ambition of producing 30% recycled polymers by 2030!</p>\r\n<p><a href=\"https://lnkd.in/e87__K8\" target=\"_blank\" rel=\"noopener noreferrer\">More info</a></p>',NULL,NULL,'youtube',NULL,NULL,0,'2021-06-29 18:12:54','2021-06-29 18:12:54'),
	(181,134,'text','<p><em>Retrouvez ce post sur la page LinkedIn<strong> <a href=\"https://www.linkedin.com/posts/totalenergies-industry_environmentalimpact-sustainable-biobasedplastic-activity-6811617889771159552-IEVO\" target=\"_blank\" rel=\"noopener noreferrer\">TotalEnergies Industry Solutions</a></strong>.</em></p>',NULL,NULL,'youtube',NULL,NULL,1,'2021-06-29 18:12:54','2021-06-29 18:12:54'),
	(182,135,'text','<p>Did you know ? For several years now, TotalEnergies&rsquo; Refining &amp; Chemicals segment has been implementing an industrial program designed to improve the #availability of its units.</p>\r\n<p>Its goals ?</p>\r\n<ul>\r\n<li>to operate continuously</li>\r\n<li>to meet customer needs.</li>\r\n</ul>\r\n<p>This program also contributes to Refining &amp; Chemicals&rsquo; ambition by :</p>\r\n<ul>\r\n<li>enhancing #safety</li>\r\n<li>reducing CO2 emissions</li>\r\n<li>controlling costs</li>\r\n<li>increasing our performance.<br />&nbsp;</li>\r\n</ul>',NULL,NULL,'youtube',NULL,NULL,0,'2021-06-29 18:14:46','2021-06-29 18:14:46'),
	(183,135,'text','<p><em>Retrouvez ce post sur la page LinkedIn <a href=\"https://www.linkedin.com/posts/totalenergies-industry_availability-safety-totalenergiesindustrysolutions-activity-6813817481237475328-bYFc\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>TotalEnergies Industry Solutions</strong></a>.</em></p>',NULL,NULL,'youtube',NULL,NULL,1,'2021-06-29 18:14:46','2021-06-29 18:14:46'),
	(184,136,'text','<p>Did you know?</p>\r\n<p>TotalEnergies produces #polymers to make artificial grass yarn for sport artificial grass fields?</p>\r\n<p>Lumicene&reg; M3427 is a metallocene catalyzed polyethylene based on TotalEnergies&rsquo;s proprietary catalyst technology which provides good environmental performance such as :</p>\r\n<ul>\r\n<li>a lifetime that is at least 50% longer than fibers made from standard #polyethylene.</li>\r\n<li>33% energy savings*</li>\r\n<li>33% reduced CO2 emissions*</li>\r\n</ul>\r\n<p>This is a new step towards TotalEnergies&rsquo;s #NetZero ambition to offer its customers low carbon products and solutions.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>For more info, please go visit <a href=\"https://ecosolutions.totalenergies.com/en/products-services/polyethylene-lumicener-m3427\" target=\"_blank\" rel=\"noopener noreferrer\">TotalEnergies Ecosolutions site</a></p>\r\n<p>*Source: TotalEnergies Ecosolutions</p>\r\n<p>&nbsp;</p>',NULL,NULL,'youtube',NULL,NULL,0,'2021-06-29 18:17:06','2021-06-29 18:17:06'),
	(185,136,'text','<p><em>Retrouvez ce post sur la page LinkedIn <a href=\"https://www.linkedin.com/posts/totalenergies-industry_availability-safety-totalenergiesindustrysolutions-activity-6813817481237475328-bYFc\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>TotalEnergies Industry Solutions</strong></a>.</em></p>',NULL,NULL,'youtube',NULL,NULL,1,'2021-06-29 18:17:06','2021-06-29 18:17:06'),
	(186,144,'text','<p><strong>En phase avec le mouvement de transformation de la compagnie, la branche Raffinage-Chimie va faire &eacute;voluer son organisation. Le point avec Bernard Pinatel.</strong></p>\r\n<p><br /><strong>En quoi consiste le projet d&rsquo;&eacute;volution de l&rsquo;organisation de la branche &agrave; compter de septembre prochain ? Pourquoi ces mouvements ?</strong></p>\r\n<p><strong>Bernard Pinatel&nbsp;</strong>: La cr&eacute;ation de la branche &laquo; One Tech &raquo; qui regroupe l&rsquo;ensemble des comp&eacute;tences technologiques et de R&amp;D de la compagnie a une incidence sur l&rsquo;organisation du RC, principalement sur les directions Industrielle et Strat&eacute;gie-D&eacute;veloppement-Recherche, dont un grand nombre des collaborateurs va rejoindre cette nouvelle branche. Il fallait donc, dans ce nouveau cadre, nous red&eacute;ployer en prenant en compte les missions des &eacute;quipes de ces directions qui restent au RC.</p>\r\n<p><strong>Quelles seront donc ces modifications ?</strong></p>\r\n<p><strong>B. P.&nbsp;</strong>: Trois mouvements principaux vont avoir lieu :</p>\r\n<p>Les fonctions n&eacute;cessaires au pilotage de la performance industrielle, rattach&eacute;es jusqu&rsquo;ici &agrave; la direction Industrielle, vont int&eacute;grer le Secr&eacute;tariat G&eacute;n&eacute;ral (SG), qui sera renomm&eacute; Secr&eacute;tariat G&eacute;n&eacute;ral et Performance (SGP), plac&eacute; sous la responsabilit&eacute; de Philippe Orts. Cela concerne les d&eacute;partements Disponibilit&eacute;, CO2, Digital et Contr&ocirc;le de gestion/Cost Saving Plan.<br />Les fonctions qui contribuent &agrave; l&rsquo;&eacute;laboration de la strat&eacute;gie de croissance du RC, jusqu&rsquo;ici rattach&eacute;es &agrave; la direction Strat&eacute;gie-D&eacute;veloppement-Recherche (SDR), seront supervis&eacute;es par Fran&ccedil;ois Good, directeur de la Business Unit Raffinage-P&eacute;trochimie Orient (RPO) qui sera renomm&eacute;e Raffinage-P&eacute;trochimie Orient - Growth (RPO-G). Cela concerne les d&eacute;partements Etudes strat&eacute;giques, Business Intelligence &amp; March&eacute;s, Etudes &eacute;conomiques, M&amp;A, R&eacute;glementation et Produits et Relations institutionnelles qui constitueront une nouvelle direction Strategy &amp; Growth (STG).<br />Enfin un dernier mouvement concernera les &eacute;quipes de RETIA qui int&eacute;greront la Business Unit Raffinage Base Chem Europe (RBE), dirig&eacute;e par Michel Charton.  La vocation de RETIA &agrave; g&eacute;rer des projets de d&eacute;mant&egrave;lement et rem&eacute;diation pour l&rsquo;ensemble des branches et entit&eacute;s de la compagnie a &eacute;t&eacute; r&eacute;affirm&eacute;e. De m&ecirc;me, le r&ocirc;le op&eacute;rationnel de RETIA en cas d&rsquo;incident portant atteinte &agrave; l&rsquo;environnement (onshore) est confirm&eacute;.</p>\r\n<p><strong>Rapprocher les &eacute;quipes strat&eacute;gie et croissance des &eacute;quipes RPO signifie-t-il que l&rsquo;on n&rsquo;entrevoit la croissance de la branche que dans la zone Orient ?</strong></p>\r\n<p><strong>B. P.&nbsp;</strong>: Non, le p&eacute;rim&egrave;tre d&rsquo;activit&eacute; des &eacute;quipes &laquo; Strategy &amp; Growth &raquo; reste mondial et concerne toutes les activit&eacute;s de la branche. La Business Unit RPO-G aura bien deux missions distinctes et la supervision par un m&ecirc;me directeur ne signifie aucunement que les &eacute;quipes Strat&eacute;gie &amp; Growth seront au service exclusif de la Business Unit RPO-G. Les missions des &eacute;quipes resteront inchang&eacute;es par rapport aux missions actuelles exerc&eacute;es au sein de SDR, qui vont de l&rsquo;&eacute;laboration des hypoth&egrave;ses march&eacute; du plan long terme &agrave; l&rsquo;analyse des projets de r&eacute;glementation et d&rsquo;advocacy impactant nos activit&eacute;s, en passant par le pilotage des &eacute;tudes &eacute;conomiques et strat&eacute;giques et l&rsquo;identification et l&rsquo;&eacute;valuation des opportunit&eacute;s de croissance et des risques sur les actifs et projets de la branche.</p>\r\n<p>L&rsquo;ensemble de nos activit&eacute;s est concern&eacute; par la transformation de la compagnie et les opportunit&eacute;s de d&eacute;veloppement concernent tous nos business, sur toutes les zones g&eacute;ographiques.</p>\r\n<p><strong>Les missions du Secr&eacute;tariat g&eacute;n&eacute;ral seront-elles modifi&eacute;es &agrave; la suite de l&rsquo;int&eacute;gration de fonctions anciennement rattach&eacute;es &agrave; la direction Industrielle ?</strong></p>\r\n<p><strong>B. P.&nbsp;</strong>: Modifi&eacute;es non, car une des missions du Secr&eacute;tariat G&eacute;n&eacute;ral est d&eacute;j&agrave; d&rsquo;assurer le contr&ocirc;le de la performance de la branche. Mais ces missions seront &eacute;largies &agrave; la performance industrielle. Ainsi reconfigur&eacute;, le Secr&eacute;tariat G&eacute;n&eacute;ral et Performance aura les moyens d&rsquo;agir sur tous les leviers de la performance, dont le but ultime est le renforcement de notre comp&eacute;titivit&eacute; industrielle, premier pilier de notre strat&eacute;gie. Par exemple la ma&icirc;trise des co&ucirc;ts, avec &agrave; la fois les actions de la direction Finance et celle du d&eacute;partement Contr&ocirc;le de gestion qui pilote le Cost saving plan, ou encore le digital, avec la direction des Syst&egrave;mes d&rsquo;information et le d&eacute;partement Digital charg&eacute; de piloter et coordonner les actions de transformation digitale au sein de la branche. La direction SGP aura &eacute;galement en charge l&rsquo;animation et la consolidation des initiatives en mati&egrave;re de disponibilit&eacute;, de r&eacute;duction de l&rsquo;empreinte carbone et de l&rsquo;efficacit&eacute; &eacute;nerg&eacute;tique des sites industriels.</p>\r\n<p><strong>En conclusion, un dernier message sur cette nouvelle organisation ?</strong></p>\r\n<p><strong>B. P.&nbsp;</strong>: La branche raffinage-Chimie participe pleinement &agrave; la transformation de TotalEnergies en une compagnie multi-&eacute;nergies par son engagement dans des activit&eacute;s bas carbone, la r&eacute;duction de l&rsquo;empreinte carbone de ses activit&eacute;s traditionnelles et le recyclage des plastiques. Au 1er mai, nous avons cr&eacute;&eacute; une nouvelle Business Unit, &ldquo;Renewable Fuels&rdquo;, sous la direction de Virginie Merini, pour acc&eacute;l&eacute;rer notre d&eacute;veloppement sur le march&eacute; des carburants renouvelables. Le RC a un r&ocirc;le central &agrave; jouer dans la transformation de la compagnie et j&rsquo;ai confiance en notre capacit&eacute; collective &agrave; relever les d&eacute;fis qui nous attendent pour les ann&eacute;es &agrave; venir.  </p>\r\n<p><strong>Nouvelle organisation de la branche Raffinage-Chimie :&nbsp;</strong></p>',NULL,NULL,'youtube',NULL,NULL,0,'2021-07-06 11:27:56','2021-07-06 11:27:56'),
	(187,144,'image',NULL,NULL,'7UFPzSVEtb0FvYPLgPVj2QWBnOJa91ILOxCGICR4.png','youtube',NULL,NULL,1,'2021-07-06 11:27:58','2021-07-06 11:27:58'),
