	(3,'cgu_fr','Consulter les CGU','<p><strong>Conditions g&eacute;n&eacute;rales&nbsp;d&rsquo;utilisation</strong></p>\r\n<p>Bienvenue sur l&rsquo;application R&amp;C News&nbsp;(L&rsquo; &laquo; application &raquo;), qui relaie les informations diffus&eacute;es par le site internet www.total.com. En vous connectant ou en utilisant notre application, vous reconnaissez avoir lu, compris, et accept&eacute;, sans limitation ni r&eacute;serve, les pr&eacute;sentes conditions g&eacute;n&eacute;rales d&rsquo;utilisation et notre charte sur la&nbsp;<a href=\"https://www.total.com/fr/donnees-personnelles\" target=\"_blank\" rel=\"noopener noreferrer\">protection des donn&eacute;es &agrave; caract&egrave;re personnel et cookies</a>. Veuillez noter que si vous visitez d&rsquo;autres sites du groupe Total d\'autres conditions g&eacute;n&eacute;rales et chartes sur la protection des donn&eacute;es &agrave; caract&egrave;re personnel sont applicables sur ces sites et nous vous recommandons de les consulter.</p>\r\n<ol>\r\n<li><strong> Identit&eacute;</strong></li>\r\n</ol>\r\n<p><strong>Soci&eacute;t&eacute; &eacute;ditrice de l&rsquo;application,</strong>&nbsp;ci-apr&egrave;s la &laquo;&nbsp;Soci&eacute;t&eacute;&nbsp;&raquo;&nbsp;:</p>\r\n<p><strong>TOTAL RAFFINAGE-CHIMIE <br /></strong>Si&egrave;ge social&nbsp;: Tour Coupole - 2, place Jean Millier - 92078 Paris La D&eacute;fense Cedex &ndash; France<br />Soci&eacute;t&eacute; Anonyme de droit fran&ccedil;ais Capital de 933 605&nbsp;625,50 euros <br />Registre du commerce et des soci&eacute;t&eacute;s&nbsp;de Nanterre sous le num&eacute;ro 692&nbsp;004&nbsp;807 RCS Nanterre <br />Num&eacute;ro de TVA&nbsp;: FR 63 692004807 <br />Email&nbsp;:&nbsp;<a href=\"mailto:%20rc.news@total.com\" target=\"_blank\" rel=\"noopener noreferrer\">rc.news@total.com </a><br />T&eacute;l&eacute;phone&nbsp;: +33 1 47 44 60 00 <br />Directeur de publication&nbsp;: Direction de la Communication Raffinage-Chimie</p>\r\n<p><strong>Conception technique et d&eacute;veloppement de l&rsquo;application&nbsp;:</strong></p>\r\n<p>Webedia <br />Soci&eacute;t&eacute; Anonyme de droit fran&ccedil;ais au capital de 1 272 405 euros dont le si&egrave;ge social est situ&eacute; au 2 rue Paul Vaillant Couturier, 92&nbsp;300 Levallois-Perret<br /> Immatricul&eacute;e au Registre du Commerce et des Soci&eacute;t&eacute;s de Paris sous le num&eacute;ro 501&nbsp;106&nbsp;520<br /> T&eacute;lephone&nbsp;: +33 (0)8 11 69 41 42</p>\r\n<p><strong>Conception graphique:</strong></p>\r\n<p>Webedia <br />Soci&eacute;t&eacute; Anonyme de droit fran&ccedil;ais au capital de 1 272 405 euros dont le si&egrave;ge social est situ&eacute; au 2 rue Paul Vaillant Couturier, 92&nbsp;300 Levallois-Perret <br />Immatricul&eacute;e au Registre du Commerce et des Soci&eacute;t&eacute;s de Paris sous le num&eacute;ro 501&nbsp;106&nbsp;520 <br />T&eacute;lephone&nbsp;: +33 (0)8 11 69 41 42</p>\r\n<p><strong>H&eacute;bergement de l&rsquo;application :</strong></p>\r\n<p>Microsoft Ireland Operations Limited Soci&eacute;t&eacute; situ&eacute;e One Microsoft Place, South County Industrial Park, Leopardstown, Dublin 18, Ireland D18 P521. <br />Siren : 419 423 728 <br />T&eacute;l&eacute;phone : +33 (0)8 05 540&nbsp;594</p>\r\n<p>Les soci&eacute;t&eacute;s du groupe Total ont leur propre existence l&eacute;gale et disposent d&rsquo;une personnalit&eacute; juridique autonome. La Soci&eacute;t&eacute; qui a cr&eacute;&eacute; cette application appartient au groupe Total. Les termes &laquo;&nbsp;Total&nbsp;&raquo; et &laquo;&nbsp;le groupe Total&nbsp;&raquo; sont parfois utilis&eacute;s pour des raisons pratiques et d&eacute;signent de fa&ccedil;on g&eacute;n&eacute;rale, TOTAL S.A. (la soci&eacute;t&eacute; holding) et/ou ses filiales. De m&ecirc;me, les termes &laquo;&nbsp;nous&nbsp;&raquo;, &laquo;&nbsp;notre&nbsp;&raquo;, &laquo;&nbsp;nos&nbsp;&raquo;&nbsp;font&nbsp; r&eacute;f&eacute;rence &agrave; la Soci&eacute;t&eacute; ou toute autre soci&eacute;t&eacute; du groupe Total en g&eacute;n&eacute;ral. Il ne peut &ecirc;tre d&eacute;duit de la simple utilisation de ces expressions une quelconque implication de TOTAL S.A., ni d&rsquo;aucune de ses filiales dans les affaires ou la gestion d&rsquo;une autre soci&eacute;t&eacute; du groupe Total.</p>\r\n<ol start=\"2\">\r\n<li><strong> Informations sur les activit&eacute;s</strong></li>\r\n</ol>\r\n<p>La Soci&eacute;t&eacute; a mis en ligne cette application afin de vous pr&eacute;senter certaines activit&eacute;s de la Soci&eacute;t&eacute; et le cas &eacute;ch&eacute;ant d&rsquo;autres activit&eacute;s du groupe Total. Les informations sont fournies dans le cadre d&rsquo;une information g&eacute;n&eacute;rale, sans garantie d\'ad&eacute;quation &agrave; un besoin particulier d\'utilisation. La Soci&eacute;t&eacute; peut les modifier, mettre &agrave; jour,&nbsp; &agrave; tout moment et sans pr&eacute;avis.&nbsp;</p>\r\n<ol start=\"3\">\r\n<li><strong> Propri&eacute;t&eacute; intellectuelle</strong></li>\r\n</ol>\r\n<p><strong>3.1. Principe.&nbsp;</strong>Toutes les informations ou documents (textes, images anim&eacute;es ou non, bases de donn&eacute;es, sons, photos, savoir-faire, produits cit&eacute;s) contenus dans l&rsquo;application ainsi que tous les &eacute;l&eacute;ments cr&eacute;&eacute;s pour l&rsquo;application et sa structure g&eacute;n&eacute;rale, sont soit la propri&eacute;t&eacute; de la Soci&eacute;t&eacute; ou du groupe Total, soit font l\'objet de droits d\'utilisation, de reproduction et de repr&eacute;sentation consentis au profit de ces derniers. Ces informations, documents ou &eacute;l&eacute;ments sont soumis aux lois prot&eacute;geant le droit d\'auteur d&egrave;s lors qu\'elles sont mises &agrave; la disposition du public sur cette application. Aucune licence, ni aucun droit autre que celui de consulter l&rsquo;application, n\'est conf&eacute;r&eacute; &agrave; quiconque au regard des droits de propri&eacute;t&eacute; intellectuelle. La reproduction des documents de l&rsquo;application est autoris&eacute;e &agrave; des fins exclusives d\'information pour un usage personnel et priv&eacute;. Toute reproduction et toute utilisation de copie r&eacute;alis&eacute;e &agrave; d\'autres fins est express&eacute;ment interdite et soumise &agrave; l\'autorisation pr&eacute;alable et expresse de la Soci&eacute;t&eacute;. Dans tous les cas, la reproduction autoris&eacute;e des informations contenues dans cette application devra indiquer la source et la mention de propri&eacute;t&eacute; ad&eacute;quates.&nbsp;</p>\r\n<p><strong>3.2. Signes distinctifs.&nbsp;</strong>Sauf mention contraire, les d&eacute;nominations sociales, les logos, les produits et marques cit&eacute;s dans cette application sont la propri&eacute;t&eacute; de la Soci&eacute;t&eacute; ou du groupe Total, ou bien font l&rsquo;objet de droits d&rsquo;usage, de reproduction ou de repr&eacute;sentation qui ont &eacute;t&eacute; consentis &agrave; leur profit. Ils ne peuvent &ecirc;tre utilis&eacute;s sans l\'autorisation &eacute;crite pr&eacute;alable de la Soci&eacute;t&eacute;.</p>\r\n<p><strong>3.3. Bases de donn&eacute;es.&nbsp;</strong>Les &eacute;ventuelles bases de donn&eacute;es mises &agrave; votre disposition sont la propri&eacute;t&eacute; de la Soci&eacute;t&eacute; qui a la qualit&eacute; de producteur de bases de donn&eacute;es. Il vous est interdit d&rsquo;extraire ou de r&eacute;utiliser une partie qualitativement ou quantitativement substantielle des bases de donn&eacute;es y compris &agrave; des fins priv&eacute;es.</p>\r\n<ol start=\"4\">\r\n<li><strong> Engagement de l\'utilisateur</strong></li>\r\n</ol>\r\n<p><strong>4.1.</strong>&nbsp;Chaque utilisateur de l&rsquo;application qui fournit des informations consent &agrave; la Soci&eacute;t&eacute; l\'int&eacute;gralit&eacute; des droits transf&eacute;rables relatifs &agrave; cette information et autorise la Soci&eacute;t&eacute; &agrave; en faire usage. Les informations ainsi fournies par