eacute;es.</p>\r\n<ol start=\"4\">\r\n<li><strong>Engagement de l\'utilisateur</strong></li>\r\n</ol>\r\n<p><strong>4.1.</strong>&nbsp;Chaque utilisateur de l&rsquo;application qui fournit des informations consent &agrave; la Soci&eacute;t&eacute; l\'int&eacute;gralit&eacute; des droits transf&eacute;rables relatifs &agrave; cette information et autorise la Soci&eacute;t&eacute; &agrave; en faire usage. Les informations ainsi fournies par les utilisateurs seront consid&eacute;r&eacute;es comme non confidentielles. Toutefois, lorsque les informations fournies sont des donn&eacute;es personnelles au sens du droit applicable&nbsp;elles sont trait&eacute;es conform&eacute;ment &agrave; la charte sur la&nbsp;<a href=\"https://www.total.com/fr/donnees-personnelles\" target=\"_blank\" rel=\"noopener noreferrer\">protection des donn&eacute;es &agrave; caract&egrave;re personnel et cookies&nbsp;</a>applicable &agrave; cette application.</p>\r\n<p><strong>4.2.</strong>&nbsp;Chaque utilisateur de l&rsquo;application d&eacute;clare se conformer aux pr&eacute;sentes conditions g&eacute;n&eacute;rales d&rsquo;utilisation et lois en vigueur, en particulier :</p>\r\n<ul>\r\n<li>disposer de la comp&eacute;tence et des moyens n&eacute;cessaires pour acc&eacute;der &agrave; l&rsquo;application et l&rsquo;utiliser ;</li>\r\n<li>avoir v&eacute;rifi&eacute; que la configuration informatique utilis&eacute;e ne contient aucun virus et qu\'elle est en parfait &eacute;tat de fonctionnement ;</li>\r\n<li>consentir &agrave; la Soci&eacute;t&eacute; et &agrave; ses partenaires le cas &eacute;ch&eacute;ant le droit de faire tout usage des informations fournies (autre que des donn&eacute;es &agrave; caract&egrave;re personnel) ;</li>\r\n<li>devoir conserver confidentiels et &ecirc;tre en cons&eacute;quence responsable de l&rsquo;utilisation et de la s&eacute;curit&eacute; des codes d\'acc&egrave;s et mots de passe que la Soci&eacute;t&eacute; peut vous transmettre pour acc&eacute;der &agrave; certaines rubriques. La Soci&eacute;t&eacute; se r&eacute;serve le droit de suspendre votre acc&egrave;s &agrave; l&rsquo;application en cas d\'utilisation frauduleuse ou de tentative d\'utilisation frauduleuse de cet acc&egrave;s.</li>\r\n</ul>\r\n<ol start=\"5\">\r\n<li><strong>Liens hypertextes</strong></li>\r\n</ol>\r\n<p><strong>5.1. Activation des liens.</strong>&nbsp;La Soci&eacute;t&eacute; d&eacute;cline formellement toute responsabilit&eacute; quant aux contenus des sites vers lesquels elle offre des liens. Ces liens sont propos&eacute;s aux utilisateurs de cette application. Veuillez consulter les conditions g&eacute;n&eacute;rales et la charte sur la protection des donn&eacute;es &agrave; caract&egrave;re personnel et cookies de ces sites afin de comprendre leurs pratiques. La d&eacute;cision d\'activer les liens appartient exclusivement aux utilisateurs de l&rsquo;application. La Soci&eacute;t&eacute; peut modifier ou supprimer un lien sur notre application &agrave; tout moment.&nbsp;</p>\r\n<p><strong>5.2. Autorisation des liens.&nbsp;</strong>Si vous souhaitez cr&eacute;er un lien hypertexte avec cette application, vous devez obtenir l\'autorisation &eacute;crite et pr&eacute;alable de la Soci&eacute;t&eacute; en utilisant les coordonn&eacute;es de contact mentionn&eacute;es &agrave;&nbsp; la fin de ce document.</p>\r\n<ol start=\"6\">\r\n<li><strong>Mises en garde</strong></li>\r\n</ol>\r\n<p><strong>6.1.</strong>&nbsp;Les informations et recommandations disponibles sur cette application (&laquo; Informations &raquo;) sont propos&eacute;es de bonne foi. Elles sont cens&eacute;es &ecirc;tre correctes au moment o&ugrave; elles sont publi&eacute;es sur le site. Toutefois, la Soci&eacute;t&eacute; ne garantit pas le caract&egrave;re exhaustif et l\'exactitude de ces Informations. Vous assumez pleinement les risques li&eacute;s au cr&eacute;dit que vous leur accordez. Ces Informations vous sont fournies &agrave; la condition que vous ou toute autre personne qui les recevez puissiez d&eacute;terminer leur int&eacute;r&ecirc;t pour un objectif pr&eacute;cis avant de les utiliser. En aucun cas, la Soci&eacute;t&eacute; ne sera responsable des dommages susceptibles de r&eacute;sulter du cr&eacute;dit accord&eacute; &agrave; ces Informations ou de leur utilisation.&nbsp; Ces Informations ne doivent pas &ecirc;tre consid&eacute;r&eacute;es comme des recommandations pour l\'utilisation d\'informations, de produits, de proc&eacute;dures, d\'&eacute;quipements ou de formulations qui seraient en contradiction avec un brevet, un copyright ou une marque d&eacute;pos&eacute;e. La Soci&eacute;t&eacute; d&eacute;cline toute responsabilit&eacute;, expresse ou implicite, si l\'utilisation de ces Informations venait &agrave; contrevenir &agrave; un brevet, un copyright ou une marque d&eacute;pos&eacute;e.</p>\r\n<p>La Soci&eacute;t&eacute;, et toute soci&eacute;t&eacute; du groupe Total rejette cat&eacute;goriquement toute interpr&eacute;tation qui viserait &agrave; assimiler le contenu de ses sites internet &agrave; des offres d\'achat ou des incitations &agrave; acqu&eacute;rir des actions ou autres valeurs mobili&egrave;res cot&eacute;es ou non cot&eacute;es de la Soci&eacute;t&eacute; ou de toute autre soci&eacute;t&eacute; du groupe Total. Aucune garantie, expresse ou implicite, n\'est donn&eacute;e quant &agrave; la nature marchande des Informations fournies, ni quant &agrave; leur ad&eacute;quation &agrave; une finalit&eacute; d&eacute;termin&eacute;e, ainsi qu\'en ce qui concerne les produits auxquels il est fait r&eacute;f&eacute;rence dans ces Informations. En aucun cas, la Soci&eacute;t&eacute; ne s\'engage &agrave; mettre &agrave; jour ou &agrave; corriger les Informations qui seront diffus&eacute;es sur Internet ou sur leurs serveurs web. La Soci&eacute;t&eacute; se r&eacute;serve le droit de modifier ou de corriger le contenu de ses sites &agrave; tout moment sans pr&eacute;avis.</p>\r\n<p><strong>6.2.</strong>&nbsp;Les documents pr&eacute;sent&eacute;s sur cette application peuvent contenir des informations prospectives sur le Groupe (notamment des objectifs et tendances), ainsi que des d&eacute;clarations prospectives (forward-looking statements) au sens du Private Securities Litigation Reform Act de 1995, concernant notamment la situation financi&egrave;re, les r&eacute;sultats d&rsquo;op&eacute;rations, les activit&eacute;s et la strat&eacute;gie industrielle de TOTAL. Ces donn&eacute;es ne constituent pas des pr&eacute;visions au sens du r&egrave;glement europ&eacute;en n&deg;809/2004.</p>\r\n<p>Les informations et d&eacute;clarations prospectives contenues dans ces documents sont fond&eacute;es sur des donn&eacute;es et hypoth&egrave;ses &eacute;conomiques formul&eacute;es dans un contexte &eacute;conomique, concurrentiel et r&eacute;glementaire donn&eacute;. Elles peuvent s&rsquo;av&eacute;rer inexactes dans le futur et sont d&eacute;pendantes de facteurs de risques susceptibles de donner lieu &agrave; un &eacute;cart significatif entre les r&eacute;sultats r&eacute;els et ceux envisag&eacute;s, tels que notamment la variation des taux de change, le prix des produits p&eacute;troliers, la capacit&eacute; d&rsquo;effectuer des r&eacute;ductions de co&ucirc;ts ou des gains d&rsquo;efficacit&eacute; sans perturbation inopportune des op&eacute;rations, les consid&eacute;rations de r&eacute;glementations environnementales et des conditions &eacute;conomiques et financi&egrave;res g&eacute;n&eacute;rales. De m&ecirc;me, certaines informations financi&egrave;res reposent sur des estimations notamment lors de l&rsquo;&eacute;valuation de la valeur recouvrable des actifs et des montants des &eacute;ventuelles d&eacute;pr&eacute;ciations d&rsquo;actifs.</p>\r\n<p>Ni TOTAL ni aucune de ses filiales ne prennent l&rsquo;engagement ou la responsabilit&eacute; vis-&agrave;-vis des investisseurs ou toute autre partie prenante de mettre &agrave; jour ou de r&eacute;viser, en particulier en raison d&rsquo;informations nouvelles ou &eacute;v&eacute;nements futurs, tout ou partie des d&eacute;clarations, informations prospectives, tendances ou objectifs contenus dans ces documents. Des informations suppl&eacute;mentaires concernant les facteurs, risques et incertitudes susceptibles d&rsquo;avoir un effet sur les r&eacute;sultats financiers ou les activit&eacute;s du Groupe sont par ailleurs disponibles dans les versions les plus actualis&eacute;es du Document de r&eacute;f&eacute;rence d&eacute;pos&eacute; par la Soci&eacute;t&eacute; aupr&egrave;s de l&rsquo;Autorit&eacute; des march&eacute;s financiers et du Form 20-F d&eacute;pos&eacute; par la Soci&eacute;t&eacute; aupr&egrave;s de la United States Securities and Exchange Commission (&laquo; SEC &raquo;).</p>\r\n<p><strong>6.3.</strong>&nbsp;La Soci&eacute;t&eacute; ne garantit pas, sans que cette liste soit exhaustive, que l&rsquo;application fonctionne sans interruption et que les serveurs qui y donnent acc&egrave;s et/ou les sites tiers pour lesquels apparaissent des liens hypertextes ne contiennent pas de virus.</p>\r\n<ol start=\"7\">\r\n<li><strong>Mises &agrave; jour des conditions d\'utilisation de l&rsquo;application et loi applicable</strong></li>\r\n</ol>\r\n<p>La Soci&eacute;t&eacute; peut proc&eacute;der &agrave; la mise &agrave; jour de ces conditions d\'utilisation &agrave; tout moment. En cons&eacute;quence, vous &ecirc;tes invit&eacute;s &agrave; vous r&eacute;f&eacute;rer r&eacute;guli&egrave;rement aux derni&egrave;res conditions d\'utilisation en vigueur. Ces conditions d&rsquo;utilisation sont soumises au droit applicable et rel&egrave;vent de la comp&eacute;tence des tribunaux comp&eacute;tents.</p>\r\n<ol start=\"8\">\r\n<li><strong>Coordonn&eacute;es de contact</strong></li>\r\n</ol>\r\n<p>Pour toute question relative aux conditions d&rsquo;utilisation de l&rsquo;application, veuillez nous contacter par email&nbsp;<a href=\"mailto: rc.news@total.com\" target=\"_blank\" rel=\"noopener noreferrer\">rc.news@total.com&nbsp;</a>ou par courrier postal &agrave; l&rsquo;adresse suivante :</p>\r\n<p><strong>TOTAL RAFFINAGE-CHIMIE</strong></p>\r\n<p>Tour Coupole - 2, place Jean Millier&nbsp;<br />92078 Paris La D&eacute;fense Cedex - France&nbsp;<br />Nom du service ou du d&eacute;partement&nbsp;: Direction de la Communication Raffinage-Chimie</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2020-03-19 14:55:26','2020-05-28 09:38:51');
